(32, 37, 7, '<p>1. AC berfungsi sebagai pendingin ruangan ini menjadi yang panas</p>\r\n<p>3 cara kerja AC adalah menyerap panas dari udara di dalam ruangan kemudian melepaskan panas tersebut di luar ruangan&nbsp;</p>\r\n<p>4 bahan Pendingan berupa fluida yg di gunakan untuk menyerap kalor melelai&nbsp;</p>\r\n<p>Perubahan puasa cair ke gas dan membuang kalor melalui embun</p>\r\n<p>&nbsp;</p>', NULL, NULL, '2022-10-17 02:48:34', NULL, NULL),
(33, 62, 7, '<p>1. AC be rfungsi sebagai pendingin ruangan ini menjadi solusi jitu untuk mengatasi udara yang panas</p>\r\n<p>3. Cara kerja AC adalah menyerap panas dari udara di dalam ruangan,kemudian melepaskan panas tersebut dari luar ruangan</p>\r\n<p>4. Bahan pendingin berupa fluida yang di gunakan untuk menyerap kalor melalui perubahan phansa cair ke gas dan membuang kalor melalui embun</p>\r\n<p>&nbsp;</p>', '7_62.jpg', NULL, '2022-10-17 04:33:58', NULL, NULL),
(34, 51, 7, '<p>1.ac berfungsi sebagai pendingin ruangan ini menjadi solusi jitu untuk mengatasi udara yang panas</p>\r\n<p>3.cara kerja ac adalah menyerap panas dari udara di dalam ruangan,kemudian melepaskan panas tersebut di luar ruangan</p>\r\n<p>4.bahan pendingin berupa fluida yang di gunakan untuk menyerap kalor melalui perubahan phasa cair ke gas dan membuang kalor melalui embun</p>', '7_51.jpg', NULL, '2022-10-17 03:09:47', NULL, NULL),
(35, 46, 7, '<p>1.mendiginkan suhu ruagan atau kabin</p>\r\n<p>2.</p>\r\n<p>3.<a href=\"Cara kerja sistem AC mobil dimulai ketika Anda menyalakannya. Begitu dinyalakan, maka kompresor mulai memompa freon dalam bentuk gas dengan tekanan tinggi sampai suhunya menyentuh 100 derajat Celcius. Kekuatan pompaan kompresor akan sangat menentukan seberapa cepat AC bisa membuat kabin mobil dingin\">Cara kerja sistem AC mobil dimulai ketika Anda menyalakannya. Begitu dinyalakan, maka kompresor mulai memompa freon dalam bentuk gas dengan tekanan tinggi sampai suhunya menyentuh 100 derajat Celcius. Kekuatan pompaan kompresor akan sangat menentukan seberapa cepat AC bisa membuat kabin mobil dingin</a></p>\r\n<p>4.&nbsp;<a href=\"bahan pendingin berupa fluida yang digunakan untuk menyerap kalor melalui perubahan phasa cair ke gas (menguap) dan membuang kalor melalui perubahan phasa gas ke cair (mengembun).\"> bahan pendingin berupa fluida yang digunakan untuk menyerap kalor melalui perubahan phasa cair ke gas (menguap) dan membuang kalor melalui perubahan phasa gas ke cair (mengembun).</a></p>\r\n<p>5.</p>', '7_46.jpg', NULL, '2022-10-17 03:02:10', NULL, NULL),
(36, 48, 7, '<p>NAMA&nbsp; : ILHAM AFIFUDIN</p>\r\n<p>KLS&nbsp; &nbsp;: XII TKRO1</p>\r\n<p>&nbsp;</p>\r\n<p>1.fungsi ac adalah mendinginkan suhu ruangan atau kabin</p>\r\n<p>3.Cara kerja sistem AC mobil dimulai ketika Anda menyalakannya. Begitu dinyalakan, maka kompresor mulai memompa freon dalam bentuk gas dengan tekanan tinggi sampai suhunya menyentuh 100 derajat Celcius</p>\r\n<p>4.Refrigeran adalah bahan pendingin berupa fluida yang digunakan untuk menyerap kalor melalui perubahan phasa cair ke gas (menguap) dan membuang kalor melalui perubahan phasa gas ke cair (mengembun).</p>', '7_48.jpg', NULL, '2022-10-17 03:18:27', NULL, NULL),
(37, 63, 7, '', '7_63.jpg', NULL, '2022-10-17 03:19:23', NULL, NULL),
(38, 64, 7, '', '7_64.jpg', NULL, '2022-10-17 03:22:05', NULL, NULL),
(39, 55, 7, '', '7_55.jpg', NULL, '2022-10-17 03:37:43', NULL, NULL),
(40, 42, 7, '<p>Nama:Dwi Darmaso Rumawan</p>\r\n<p>Kelas:XII TKRO 1</p>\r\n<p>1.berfungsi untuk pendingin ruangan</p>\r\n<p>3.Cara kerja AC adalah dengan bekerja menyerap panas dari udara di dalam ruangan, kemudian melepaskan panas tersebut di luar ruangan. Dengan begitu, temperatur udara di dalam ruangan akan berangsur-angsur turun sehingga dapat menghasilakn temperatur udara yang dingin.</p>\r\n<p>4.Refrigeran adalah bahan pendingin berupa fluida yang digunakan untuk menyerap kalor melalui perubahan phasa cair ke gas (menguap) dan membuang kalor melalui perubahan phasa gas ke cair (mengembun).</p>', '7_42.jpg', NULL, '2022-10-17 03:53:10', NULL, NULL),
