(49, 78, 7, '<p>1.berfungsi sebagai pendingin ruangan</p>\r\n<p>2.kompresor ac,magnetic cluth,kondensor,dryer,expansion  valve,evaporator</p>\r\n<p>3.menyerap panas dari udara di dalam ruangan,kemudian melepaskan panas tersebut di luar ruangan</p>\r\n<p>4.bahan pendingin berupa fluida yang digunakan untuk menyerap kalor melalui perubahan phasa cair ke gas(menguap) dan membuang kalor melalui perubahan phasa gas ke cair (mengembun)</p>\r\n<p>5.gambar</p>', NULL, NULL, '2022-10-18 04:17:53', NULL, NULL);
