(17, 262, 'a:2:{i:0;s:7:\"XIITKR1\";i:1;s:7:\"XIITKR2\";}', 'PKKR/XII/28', 'Mengenal Komponen Dan Cara Kerja AC Mobil', '<p>AC pada&nbsp;<a href=\"https://www.carmudi.co.id/mobilbaru/\">mobil</a>&nbsp;terdiri dari banyak komponen dengan fungsi dan cara kerja yang berbeda-beda. Oleh karena itu, penting bagi pemilik mobil untuk mengenal lebih dalam tentang deretan komponen serta cara kerja AC mobil.</p>\r\n<p>Selain menambah pengetahuan, mengenal komponen dan cara kerja AC mobil bisa menuntun Carmudian supaya lebih peduli terhadap fitur pendingin kabin itu. Termasuk rajin merawat AC agar lebih awet&nbsp;dan terhindar dari kerusakan. Mengingat perbaikan AC mobil tidaklah murah.</p>\r\n<p>Jika AC bermasalah, perbaikannya bisa mencapai lebih dari Rp5 juta tergantung jenis kerusakannya. Daripada rusak akibat kesalahan perawatan, lebih baik mencegah agar fitur tersebut awet.</p>\r\n<p>&nbsp;</p>\r\n<h2><span id=\"Komponen_dan_Cara_Kerja_AC_Mobil\">Komponen dan Cara Kerja AC Mobil</span></h2>\r\n<p>Jika dijabarkan secara menyeluruh, setidaknya ada lebih dari 10 komponen yang ada pada AC&nbsp;<a href=\"https://www.carmudi.co.id/mobilbaru/\">mobil</a>. Seluruh komponen ini memiliki fungsi yang berbeda-beda dalam membuat kabin menjadi sejuk hingga dingin.</p>\r\n<h3><span id=\"Kompresor_AC\">Kompresor AC</span></h3>\r\n<p>Komponen pertama yang cukup vital pada AC mobil adalah kompresor. Tugasnya memompa freon agar bisa bersirkulasi ke seluruh komponen AC yang ada di mobil.</p>\r\n<p>Sejatinya kompresor memberikan tekanan pada freon agar molekul yang ada di dalam freon bisa menjadi lebih padat dan rapat.&nbsp;</p>\r\n<p>Freon sendiri merupakan cairan yang akan berubah menjadi gas ketika ditekan oleh kompresor.</p>\r\n<p>Kompresor bekerja digerakkan oleh fanbelt yang berputar dari pulley mesin. Ketika berputar, maka akan ada poros yang terhubung ke pelat dengan beberapa buah nok.&nbsp;</p>\r\n<p>Nok ini, ketika menyentuh piston akan bergerak ke bagian depan sehingga menekan freon ke luar dengan tekanan tinggi.&nbsp;</p>\r\n<p>Saat nok terlepas dari piston, maka akan kembali bergerak ke belakang karena ada pegas yang bertugas mengembalikan. Hal ini membuat freon yang ditekan dari selang&nbsp;<em>low pressure</em>&nbsp;akan masuk ke dalam piston.</p>\r\n<p>Ketika suhu di dalam kabin sudah dingin, kompresor secara otomatis akan memutus tekanan dan menyala lagi ketika suhu mulai kurang dingin.&nbsp;</p>\r\n<p>Idealnya kompresor yang sehat akan bekerja mati dan menyala sesuai dengan sensor. Jika kompresor menyala terus-menerus, maka ada yang tidak beres dengan sistem AC mobil.</p>\r\n<h3><span id=\"Selang_Low_Pressure\">Selang&nbsp;<em>Low Pressure</em></span></h3>\r\n<p>Selanjutnya ada selang&nbsp;<em>low pressure&nbsp;</em>yang bertugas mengirimkan freon bertekanan rendah dari evaporator untuk kembali ke kompresor.&nbsp;</p>\r\n<p>Diameter selang ini kecil dengan warna khas hitam dan tahan bocor, karena hanya mengalirkan freon dengan tekanan yang rendah.&nbsp;</p>\r\n<h3><span id=\"Selang_High_Pressure\">Selang&nbsp;<em>High Pressure</em></span></h3>\r\n<p>Selang lain yang ada di komponen AC mobil adalah&nbsp;<em>high pressure</em>. Selang&nbsp;<em>high pressure&nbsp;</em>berfungsi mengirimkan freon cair dengan tekanan yang sangat tinggi.</p>\r\n<p>Bentuknya kecil dan anti bocor, umumnya selang&nbsp;<em>high pressure</em>&nbsp;ini punya ukuran diameter lebih kecil&nbsp; ketimbang selang&nbsp;<em>low pressure</em>.</p>\r\n<h3><span id=\"Kondensor\">Kondensor</span></h3>\r\n<p>Selain kompresor ada kondensor yang tugasnya mirip seperti radiator pada&nbsp;<a href=\"https://www.carmudi.co.id/mobilbaru/\">mobil</a>, yaitu untuk melepaskan panas ke udara bebas.&nbsp;</p>\r\n<p>Panas yang dimaksud berasal dari dalam freon yang harus dikeluarkan semaksimal mungkin. Biasanya kondensor dipasang di bagian depan atau samping radiator pada mobil.</p>\r\n<p>Kondensor memiliki komponen bernama&nbsp;<em>core</em>, berbentuk sirip dengan sifat konduktor. Udara panas yang ada pada freon akan dipindahkan ke bagian sirip-sirip ini.</p>\r\n<p>Agar lebih maksimal, kondensor dibantu dengan komponen bernama&nbsp;<em>cooling fan&nbsp;</em>agar suhu lebih cepat dingin.&nbsp;</p>\r\n<h3><span id=\"Cooling_Fan_atau_Extra_Fan\">Cooling Fan atau Extra Fan</span></h3>\r\n<p>Agar kerja kondensor bisa lebih maksimal, maka dibantu dengan&nbsp;<em>cooling fan</em>. Cooling fan punya 2 tugas sekaligus, mendinginkan radiator dan mendinginkan kondensor yang ada di dekat radiator.</p>\r\n<p>Ketika AC dinyalakan, maka kipas akan memberikan hembusan udara yang melewati kondensor sehingga suhu freon yang ada di dalam kondensor akan menjadi lebih dingin.&nbsp;</p>\r\n<p>Jika cooling fan atau extra fan mati, maka komponen AC tidak akan bekerja maksimal. Suhu yang dihasilkan juga tak bisa dingin.</p>\r\n<h3><span id=\"Tabung_Dryer\">Tabung&nbsp;<em>Dryer</em></span></h3>\r\n<p>Ini merupakan komponen tambahan, cara kerjanya mirip seperti filter udara. Namun sebenarnya fungsi utama&nbsp;<em>dryer</em>&nbsp;adalah mengeringkan cairan freon dari uap air.</p>\r\n<p>Biasanya komponen ini berupa tabung dengan lubang kaca untuk melihat kondisi bagian dalam&nbsp;<em>dryer</em>.&nbsp;</p>\r\n<p>Di bagian dalam&nbsp;<em>dryer</em>&nbsp;terdapat butiran pasir silika yang bisa mengikat uap air saat terbawa aliran pada freon.&nbsp;</p>\r\n<h3><span id=\"Katup_Ekspansi\">Katup Ekspansi</span></h3>\r\n<p><em>Expansion valve</em>&nbsp;atau katup ekspansi juga menjadi salah satu komponen penting yang ada di dalam AC&nbsp;<a href=\"https://www.carmudi.co.id/mobilbaru/\">mobil</a>.&nbsp;</p>\r\n<p>Fungsinya cukup untuk mengubah freon yang cair menjadi gas untuk disemburkan ke dalam kabin. Cara kerjanya mirip dengan spray atau parfum.</p>\r\n<p>Cairan freon yang ada di dalam katup punya tekanan yang sangat tinggi akibat ditekan oleh kompresor.&nbsp;</p>\r\n<p>Ketika freon keluar ke ruang yang tekanannya lebih rendah dengan kecepatan yang tinggi, maka akan membuat suhu menjadi dingin.&nbsp;</p>\r\n<p>Proses spray inilah yang digunakan supaya freon semakin dingin sebelum dimasukkan ke dalam evaporator.&nbsp;</p>\r\n<h3><span id=\"Evaporator\">Evaporator</span></h3>\r\n<p>Setelah dispray, freon tersebut akan masuk ke dalam evaporator yang fungsi utamanya mendinginkan udara yang akan didistribusikan ke dalam kabin.</p>\r\n<p>Secara prinsip kerja mirip dengan kondensor, mengirimkan freon bersuhu dingin ke bagian&nbsp;<em>core&nbsp;</em>yang terdapat sirip konduktor mirip yang ada di kondensor.</p>\r\n<p>Suhu dingin ini akan dikirim merata ke semua bagian sirip core, sehingga ketika udara dihembuskan melewati sirip yang ada di evaporator ini suhunya akan menjadi berkurang.</p>\r\n<p>Udara dingin inilah yang bisa kita nikmati dari hembusan yang berasal dari kisi-kisi AC mobil.&nbsp;</p>\r\n<h3><span id=\"Blower_AC\">Blower AC</span></h3>\r\n<p>Komponen lain adalah blower AC yang cara kerjanya menghembuskan udara dingin agar melewati evaporator. Blower inilah yang menghembuskan udara dingin dari kisi-kisi AC.&nbsp;</p>\r\n<p>Ketika kenop AC dinyalakan, maka blower akan berputar sehingga udara bisa melewati kisi-kisi AC.&nbsp;</p>\r\n<p>Umumnya blower ini berbentuk bulat mirip seperti kandang hamster dengan dipenuhi kisi-kisi di dalam bulatan tersebut.&nbsp;</p>\r\n<h3><span id=\"Freon\">Freon</span></h3>\r\n<p>Freon merupakan gas bersuhu normal yang dingin.&nbsp;Freon punya suhu hampir 0 derajat celcius dengan ketahanan panas yang sangat baik.</p>\r\n<p>Freon yang digunakan untuk mobil berbeda-beda. Untuk mengetahui perbedaannya, pihak pembuat freon telah menyematkan kode tertentu.</p>\r\n<p>Biasanya kode freon terdapat di bagian dekat kompresor AC memakai stiker penanda.</p>\r\n<p>Beberapa jenis freon di antaranya ada R12, R22,&nbsp;<em>hydrocarbon&nbsp;</em>dan R134a yang kini lumrah dipakai mobil keluaran terbaru.</p>\r\n<p>Freon jenis R134a dinilai lebih ramah lingkungan karena tidak merusak lapisan ozon.&nbsp;</p>\r\n<h2><span id=\"Perawatan_AC_Mobil\">Perawatan AC Mobil</span></h2>\r\n<p>Setelah mengetahui komponen dan cara kerja AC , tidak ada salahnya menge<a href=\"https://www.carmudi.co.id/mobilbaru/\">mobil</a>tahui juga cara perawatan AC yang benar.</p>\r\n<p>Banyak orang mengabaikan perawatan AC, sehingga fitur ini bisa cepat rusak dan hembusan udara menjadi tidak dingin.</p>\r\n<h3><span id=\"Mematikan_AC_dengan_Benar\">Mematikan AC dengan Benar</span></h3>\r\n<p>Banyak pemilik mobil langsung mematikan mesin ketika AC masih menyala.&nbsp; Jika dilakukan secara terus-menerus bisa merusak komponen AC.</p>\r\n<p>Usahakan ketika ingin mematikan mesin mobil matikan AC terlebih dahulu. Setelah AC mati, beri jeda sekira 1 menit baru Carmudian bisa mematikan mesin.&nbsp;</p>\r\n<p>Ketika mematikan mesin saat AC masih menyala bisa membuat kompresor berhenti mendadak. Lama kelamaan kompresor dan alternator bisa rusak.</p>\r\n<p>Makanya sangat penting mematikan AC terlebih dahulu sebelum mematikan mesin. Begitupun sebaliknya ketika menyalakan mesin, jangan langsung menyalakan AC.</p>\r\n<p>Biarkan mesin menyala sekira 1 menit baru bisa menyalakan AC. Tujuannya agar beban kerja mesin dan alternator tidak terlalu besar.</p>\r\n<h3><span id=\"Rajin_Mengecek_dan_Membersihkan_AC\">Rajin Mengecek dan Membersihkan AC</span></h3>\r\n<p>Penting juga untuk mengecek kondisi komponen AC setidaknya 1 tahun sekali, terutama pada mobil yang usianya sudah lebih dari 5 tahun.&nbsp;</p>\r\n<p>Ada beberapa komponen yang wajib dibersihkan secara berkala seperti filter AC dalam kabin, pengecekan freon, atau pembersihan kondensor.</p>\r\n<div id=\"attachment_44723\" class=\"wp-caption aligncenter\"><a href=\"https://www.carmudi.co.id/journal/wp-content/uploads/2019/02/ac-service.jpg\"><img class=\"wp-image-44723\" src=\"https://www.carmudi.co.id/journal/wp-content/uploads/2019/02/ac-service.jpg\" sizes=\"(max-width: 700px) 100vw, 700px\" srcset=\"https://www.carmudi.co.id/journal/wp-content/uploads/2019/02/ac-service.jpg 616w, https://www.carmudi.co.id/journal/wp-content/uploads/2019/02/ac-service-300x207.jpg 300w\" alt=\"cara kerja ac mobil\" width=\"700\" height=\"483\" aria-describedby=\"caption-attachment-44723\" /></a>\r\n<p id=\"caption-attachment-44723\" class=\"wp-caption-text\">Ilustrasi pengisian freon AC mobil (Foto: Bluegrassprecision)</p>\r\n</div>\r\n<p>Jika ingin melakukan sendiri bisa membersihkan kondensor ketika sedang mencuci mobil. Tujuannya, untuk menyingkirkan debu atau kotoran yang menempel.</p>\r\n<h3><span id=\"Menyalakan_AC_dengan_Benar\">Menyalakan AC dengan Benar</span></h3>\r\n<p>Kesalahan yang kerap ditemui saat menyalakan AC mobil adalah langsung memposisikan AC pada fan tertinggi ketika&nbsp;<a href=\"https://www.carmudi.co.id/mobilbaru/\">mobil</a>&nbsp;diparkir di bawah terik matahari.</p>\r\n<p>Cara tersebut bisa merusak AC, sebaiknya buang dulu udara panas di dalam kabin dengan cara membuka seluruh kaca agar ada perputaran udara dan posisikan knop AC maksimal di angka 2.</p>\r\n<p>Suhu kabin yang sangat panas bisa membuat AC mobil bekerja ekstra keras untuk mendinginkan kabin.</p>\r\n<h3><span id=\"Tidak_Merokok_dan_Membuka_Kaca\">Tidak Merokok dan Membuka Kaca</span></h3>\r\n<p>Sering merokok dalam mobil sambil membuka kaca jendela, tapi AC tetap dibiarkan menyala merupakan kebiasaan yang bisa merusak AC.</p>\r\n<p>Ketika merokok tetapi AC tetap dinyalakan dan kaca dibuka, kinerja kompresor akan menjadi berat untuk mendinginkan suhu dalam kabin. Dalam jangka panjang akan merusak kompresor AC.</p>\r\n<div id=\"attachment_38298\" class=\"wp-caption aligncenter\">\r\n<p id=\"caption-attachment-38298\" class=\"wp-caption-text\">Kebiasaan merokok saat berkendara menyebabkan kabin mobil menjadi bau dan bercak-bercak di plafon (Google)</p>\r\n</div>\r\n<p>Asap rokok yang terjebak di kabin bersama debu yang masuk dari luar mobil bisa membuat filter AC menjadi cepat kotor. Akhirnya pendinginan dalam kabin kurang maksimal, kabin pun menjadi bau.</p>\r\n<p>Setelah mengetahui komponen yang ada serta cara kerja AC&nbsp;<a href=\"https://www.carmudi.co.id/mobilbaru/\">mobil</a>, setidaknya Carmudian bisa lebih paham jika sebenarnya kerja AC cukup berat ketika sedang menyala.</p>\r\n<p>&nbsp;</p>\r\n<p>LINK PENJELASAN</p>\r\n<ol>\r\n<li>https://www.youtube.com/watch?v=fmYBI6qjPfQ&amp;ab_channel=Autoexpose</li>\r\n<li>https://www.youtube.com/watch?v=fqw4mXtE5YE&amp;ab_channel=DAROINIotomotif</li>\r\n</ol>', NULL, '2022-10-16 20:50:00', '', '2022-10-16 13:52:02', NULL);
