(148, 11, 34, '<p>Sistem pendingin AC di kendaraan terdiri dari beberapa komponen utama yaitu&hellip;.</p>', 1, '<p>Kompresor, radiator, receiver drive, katup ekspansi, evaporator, dan blower</p>', '<p>Kompresor, kondensor, receiver drive, katup ekspansi, evaporator, dan blower</p>', '<p>Pompa vakum, kondensor, receiver drive, katup ekspansi, evaporator, dan blower</p>', '<p>Kompresor, kondensor, air filter, katup ekspansi, evaporator, dan blower</p>', '<p>Kompresor, kondensor, receiver drive, katup solenoid, evaporator, dan blower</p>', 'B', '', '', '', '', '', '', ''),
(149, 11, 35, '<p>Komponen sistem AC mobil yang berfungsi mengubah gas menjadi cairan refrigerant adalah&hellip;.</p>', 1, '<p>Expansion valve</p>', '<p>Kompresor</p>', '<p>Heater core</p>', '<p>Hot expansion</p>', '<p>Heat circulator</p>', 'C', '', '', '', '', '', '', ''),
(150, 11, 36, '<p>Pada AC di negara musim dingin, fungsinya berbeda dengan AC yang berada di iklim tropis. Di iklim tropis, AC berfungsi sebagai pendingin ruangan, sedangkan di iklim dingin AC berfungsi sebagai penghangat ruangan. Pada komponen AC ini, air panas radiator dapat dihembuskan oleh blower disirkulasikan melalui&hellip;</p>', 1, '<p>Evaporator</p>', '<p>Heat blower</p>', '<p>Heater core</p>', '<p>Hot expansion</p>', '<p>Heat circulator</p>', 'C', '', '', '', '', '', '', ''),
(151, 11, 37, '<p>Saat sistem tekanan terlalu tinggi, saklar tekan ganda pada sistem kelistrikan AC berfungsi untuk&hellip;.</p>', 1, '<p>Melindungi sistem AC</p>', '<p>Mematikan sistem AC secara otomatis</p>', '<p>Menurunkan tekanan dalam sistem secara cepat</p>', '<p>Menghentikan aliran gas freon</p>', '<p>Menurunkan tekanan dalam sistem secara perlahan</p>', 'A', '', '', '', '', '', '', ''),
(152, 11, 38, '<p>Untuk menghindari berkurangnya efek pendinginan yang disebabkan pembekuan air yang ada di sirip evaporator yang terlalu dingin, maka perlu ditambahkan&hellip;.</p>', 1, '<p>Anti-frosting devices</p>', '<p>Elemen pemanas</p>', '<p>Pressure switch</p>', '<p>Blower</p>', '<p>Expansion valve</p>', 'A', '', '', '', '', '', '', ''),
(153, 11, 39, '<p>Cara untuk mendeteksi gangguan pada sistem penyejuk udara dapat diketahui melalui kaca duga. Berikut merupakan indikasi-indikasi yang muncul pada kaca duga kecuali&hellip;.</p>', 1, '<p>Kaca duga bersih menunjukkan muatan yang pas</p>', '<p>Gelembung muncul tiba-tiba saat dihidupkan merupakan gejala normal</p>', '<p>Jumlah gelembung banyak seperti busa menunjukkan refrigerant sangat sedikit</p>', '<p>Bila pada kaca terdapat garis-garis oli berarti refrigerant sudah kosong</p>', '<p>Kaca duga bersih refrigerant di dalam sistem kosong sehingga ruang penumpang akan terasa panas</p>', 'E', '', '', '', '', '', '', ''),
(154, 11, 40, '<p><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Proses penyerapan panas pada evaporator berlangsung karena&hellip;.</span></p>', 1, '<p>Panas udara dari blower terserap oleh kisi-kisi evaporator</p>', '<p>Blower menyemburkan udara dingin</p>', '<p>Kisi-kisi evaporator menyerap panas udara</p>', '<p>Blower menaikkan tekanan udara panas</p>', '<p>Blower menurunkan tekanan udara panas</p>', 'C', '', '', '', '', '', '', ''),
(155, 22, 1, '<p>Dalam permainan bola voli kita mengenal salah satu pemain yang berperan sebagai libero yang bertugas sebagai pemain bertahan. Pada dasarnya, berdasarkan fungsi utama tersebut seorang libero tidak harus memiliki postur tubuh yang tinggi seperti pemain lain. Hal ini dikarenakan seorang libero tidak bermain di area dekat net. Adapun yang paling ditekankan bagi seorang libero adalah&hellip;.</p>', 1, '<p>Kualitas servis yang baik, memiliki kecepatan gerak yang tinggi, dan memiliki daya tahan tubuh yang baik</p>', '<p>Kualitas passing yang baik, memiliki kecepatan gerak yang tinggi, dan memiliki stamina yang baik</p>', '<p>Kualitas smash yang baik, memiliki kecepatan gerak yang tinggi, dan memiliki stamina yang baik</p>', '<p>Kualitas servis yang baik, memiliki kecepatan gerak yang tinggi, dan memiliki stamina yang baik</p>', '<p>Kualitas yang baik dalam melakukan passing atas dan juga passing bawah sehingga smasher dapat melakukan pukulan dengan baik</p>', 'B', '', '', '', '', '', '', ''),
(156, 22, 2, '<p>Pola penyerangan dalam permainan bola voli sangatlah berpengaruh pada point atau kemenangan yang akan diperoleh oleh sebuah tim. Dalam hal ini keterampilan individu pemain maupun kolektivitas tim yang bisa menunjang keberhasilan sebuah tim. Oleh karena itu, berhasil tidaknya suatu penyerangan dalam permainan bola voli sebagian besar tergantung dari&hellip;.</p>', 1, '<p>Kualitas pemberi bola</p>', '<p>Bendungan pihak oposisi</p>', '<p>Pukulan bola dengan keras</p>', '<p>Jangkauan bola sejauh-jauhnya</p>', '<p>Kualitas pukulan service</p>', 'A', '', '', '', '', '', '', ''),
(157, 22, 3, '<p>Posisi pemain ini sangat penting dalam sebuah tim sepak bola. Dia harus mampu membaca permainan lawan dan menjalin koordinasi yang baik dengan pemain lain terutama winger. Selain reflek yang bagus, penempatan posisi yang tepat sangat diperlukan untuk menjaga agar timnya bisa mencetak gol. Pemain tersebut sangat pas berposisi sebagai&hellip;.</p>', 1, '<p>Center back</p>', '<p>Play maker</p>', '<p>Defending mindfilder</p>', '<p>Penjaga gawang</p>', '<p>Striker</p>', 'E', '', '', '', '', '', '', ''),
(158, 22, 4, '<p>Selain dapat digunakan untuk menggiring bola, kaki bagian luar juga dapat digunakan untuk melakukan passing. Bagian kaki yang digunakan untuk melakukan passing yang tepat adalah kaki bagian&hellip;.</p>', 1, '<p>Dalam</p>', '<p>Luar</p>', '<p>Ujung</p>', '<p>Bawah</p>', '<p>Punggung kaki</p>', 'A', '', '', '', '', '', '', ''),
(159, 22, 5, '<p>Tujuan utama permainan sepak bola adalah&hellip;</p>', 1, '<p>Memasukkan bola ke gawang lawan dan mempertahankan gawang agar tidak terjadi gol</p>', '<p>Menguasai bola selama-lamanya</p>', '<p>Berusaha merebut bola dari lawan</p>', '<p>Menghibur penonton</p>', '<p>Berusaha mematahkan serangan lawan untuk melindungi gawang</p>', 'A', '', '', '', '', '', '', ''),
(160, 22, 6, '<p>Negara pertama kali yang memperkenalkan permainan sepak bola adalah &hellip;.</p>', 1, '<p>Inggris</p>', '<p>German</p>', '<p>Italia</p>', '<p>Amerika</p>', '<p>Perancis</p>', 'A', '', '', '', '', '', '', ''),
(161, 22, 7, '<p>Permainan sepak bola dalam melakukan lemparan harus sesuai dengan peraturan yang berlaku, salah satu peraturannya adalah&hellip;</p>', 1, '<p>Melempar satu tangan</p>', '<p>Melempar dengan kaki melebihi atau masuk garis samping lapangan</p>', '<p>Melempar dengan menginjak garis</p>', '<p>Melempar dengan pelan</p>', '<p>Melempar dengan kaki tidak boleh diangkat</p>', 'E', '', '', '', '', '', '', ''),
