(163, 22, 9, '<p>Untuk mengoper bola dengan cara memantulkan bola dalam permainan bola basket dinamakan&hellip;.</p>', 1, '<p>Chest pass</p>', '<p>Bounce pass</p>', '<p>Overhead pass</p>', '<p>Shooting</p>', '<p>Rebounding</p>', 'B', '', '', '', '', '', '', ''),
(164, 22, 10, '<p>Dalam permainan bola basket, jika seorang pemain bertahan melakukan pelanggaran perseorangan didalam daerah bersyarat dengan mendorong penyerang saat melakukan drible, maka wasit akan menghukum dengan&hellip;.</p>', 1, '<p>Penalty</p>', '<p>Jump-bal</p>', '<p>Side throw</p>', '<p>Free trow</p>', '<p>Tembakan bebas</p>', 'D', '', '', '', '', '', '', ''),
(165, 22, 11, '<p>Teknik memutar bola dengan salah satu kaki sebagai poros pada pemain bola basket disebut&hellip;.</p>', 1, '<p>Pivot</p>', '<p>Lay-up</p>', '<p>Passing</p>', '<p>Reabond</p>', '<p>Shooting</p>', 'A', '', '', '', '', '', '', ''),
(166, 22, 12, '<p>Gerakan lari jarak menengah sedikit berbeda dengan gerak lari cepat.&nbsp;Perbedaan itu terutama pada&hellip;</p>', 1, '<p>Cara kaki melangkah</p>', '<p>Cara kaki menapak</p>', '<p>Pengambilan mulai</p>', '<p>Cara masuk finish</p>', '<p>Posisi start</p>', 'B', '', '', '', '', '', '', ''),
(167, 22, 13, '<p>Start yang dipakai dalam lari jarak pendek adalah&hellip;.</p>', 1, '<p>Jongkok</p>', '<p>Duduk</p>', '<p>Berdiri</p>', '<p>Miring</p>', '<p>Melayang</p>', 'A', '', '', '', '', '', '', ''),
(168, 22, 14, '<p>Tinggi net bolavoli putri yang resmi sesuai standar PBVSI adalah&hellip;.</p>', 1, '<p>2,24 m</p>', '<p>2,42 m</p>', '<p>2,43 m</p>', '<p>2,34 m</p>', '<p>2,23 m</p>', 'A', '', '', '', '', '', '', ''),
(169, 22, 15, '<p>Dalam permainan sepak bola bagian tubuh yang tidak diperbolehkan adalah&hellip;.</p>', 1, '<p>Bola terkena kepala</p>', '<p>Bola diambil dengan kaki&nbsp;&nbsp;</p>', '<p>Bola diambil dengan lutut</p>', '<p>Bola kena tangan</p>', '<p>Bola terkena punggung</p>', 'D', '', '', '', '', '', '', ''),
(170, 22, 16, '<p>Yang termasuk dalam teknik dasar bermain bola voli adalah&hellip;.</p>', 1, '<p>Lay up</p>', '<p>Jump tos</p>', '<p>Dribbling</p>', '<p>Heading</p>', '<p>Shooting</p>', 'B', '', '', '', '', '', '', ''),
(171, 22, 17, '<p>Melakukan olahraga renang secara rutin akan mendapat manfaat&hellip;.</p>', 1, '<p>Mencerahkan kulit</p>', '<p>Menambah teman</p>', '<p>Melatih pernafasan</p>', '<p>Tambah berat badan</p>', '<p>Melatih kelincahan</p>', 'C', '', '', '', '', '', '', ''),
(172, 22, 18, '<p>Posisi perkenaan bola yang benar dalam teknik menyundul bola (heading) adalah&hellip;</p>', 1, '<p>Kepala bagian depan (kening)</p>', '<p>kepala bagian tengah</p>', '<p>kepala bagian samping</p>', '<p>kepala bagian atas</p>', '<p>kepala bagian belakang</p>', 'A', '', '', '', '', '', '', ''),
(173, 22, 19, '<p>Teknik pukulan datar yang diarahkan menuju arah lawan dalam badminton disebut</p>', 1, '<p>Forehand</p>', '<p>Backhand</p>', '<p>Lob</p>', '<p>Drive</p>', '<p>Dropshot</p>', 'D', '', '', '', '', '', '', ''),
(174, 22, 20, '<p>Berikut ini merupakan keuntungan dalam pegangan forehand dalam permainan bulutangkis ....</p>', 1, '<p>pegangan raket kuat dan tidak mudah lepas</p>', '<p>pegangan raket ringan dan mudah dipindah</p>', '<p>pegangan raket mudah dilakukan dan dipindahkan</p>', '<p>pegangan raket mudah dilakukan dan mudah dilepas</p>', '<p>pegangan raket mudah dipindahkan dan mudah lepas</p>', 'B', '', '', '', '', '', '', ''),
(175, 22, 21, '<p>Servis yang dilakukan untuk mengecoh lawan dengan melambungkan shuttlekock ke belakang lapangan adalah</p>', 1, '<p>Drive serve</p>', '<p>Flick serve</p>', '<p>Lob serve</p>', '<p>Overhead serve</p>', '<p>Long service</p>', 'B', '', '', '', '', '', '', '');
INSERT INTO `soal` (`id_soal`, `id_mapel`, `nomor`, `soal`, `jenis`, `pilA`, `pilB`, `pilC`, `pilD`, `pilE`, `jawaban`, `file`, `file1`, `fileA`, `fileB`, `fileC`, `fileD`, `fileE`) VALUES
(176, 22, 22, '<p>Perhatikan gerakan berikut:</p>\r\n<ol>\r\n<li>Berdiri menghadap arah datangnya bola, salah satu kaki di depan, kedua lutut ditekuk, dan badan agak dicondongkan ke depan.</li>\r\n<li>Kedua tangan saling berpegangan, salah satu punggung telapak tangan berada pada telapak tangan yang lain.</li>\r\n<li>Ketika bola datang, ayunkan kedua lengan dari bawah, sumbu gerakan dari persendian bahu, dan sikut iurus.</li>\r\n<li>Perkenaan bola pada bagian atas pergelangan tangan.</li>\r\n<li>Setelah melakukan gerak operan, langkahkan kaki belakang ke depan untuk mengambil posisi siap.</li>\r\n</ol>\r\n<p>Uraian di atas menjelaskan tentang permainan bola voli teknik&hellip;.</p>', 1, '<p>Passing bawah</p>', '<p>Smash</p>', '<p>Blocking</p>', '<p>Service</p>', '<p>Passing atas</p>', 'A', '', '', '', '', '', '', ''),
(177, 22, 23, '<p>Pemain bola voli yang menempati posisi didepan net yang mempunyai tugas sebagai pengatur arah serangan dan memberikan umpan kepada penyerang utama adalah .....</p>', 1, '<p>Utility</p>', '<p>Set-uper</p>', '<p>Blocker</p>', '<p>Spiker</p>', '<p>Libero</p>', 'B', '', '', '', '', '', '', ''),
(178, 22, 24, '<p>Pada permainan bola voli seorang pemain dari regu A melkukan smash pemain dari regu B melkukan block maka poin dan servis akan diberikan pada regu A apabila ....</p>', 1, '<p>Bola keluar menyentuh pemain regu A</p>', '<p>Bola jatuh diluar lapangan permainan regu A</p>', '<p>Bola jatuh diluar lapangan permainan regu B</p>', '<p>Bola jatuh didalam lapangan permainan Regu A</p>', '<p>Bola jatuh dilapangan regu B pemain A menyentuh net</p>', 'C', '', '', '', '', '', '', ''),
(179, 22, 25, '<p>Dalam perlombaan lari estafet menggunakan dua bentuk / jenis start sehingga seorang pelari ketiga dalam pelaksanaan lari estafet menggunakan start .....</p>', 1, '<p>berdiri</p>', '<p>panjang</p>', '<p>jongkok</p>', '<p>melayang</p>', '<p>menengah</p>', 'A', '', '', '', '', '', '', ''),
(180, 22, 26, '<p>Dalam lari estafet 4 x 100 meter, start yang digunakan oleh pelari pertama, kedua, ketiga dan ke empat adalah .....</p>', 1, '<p>start berdiri, start berdiri, start berdiri dan start berdiri</p>', '<p>start jongkok, start berdiri, start berdiri dan start berdiri</p>', '<p>start berdiri, start melayang, start berdiri dan start melayang</p>', '<p>start jongkok, start melayang, start melayang dan start melayang</p>', '<p>start melayang, start melayang, start melayang dan start melayang</p>', 'B', '', '', '', '', '', '', ''),
(181, 22, 27, '<p>Teknik lompat tinggi dengan tahapan pada saat melakukan lompatan posisi badan diatas mistar memunggungi mistar adalah merupakan teknik gaya .....</p>', 1, '<p>gaya menggantung</p>', '<p>walking in the air</p>', '<p>gaya harimau</p>', '<p>gaya jongkok&nbsp;</p>', '<p>flop&nbsp;</p>', 'E', '', '', '', '', '', '', ''),
(182, 22, 28, '<p>Lari awalan dalam lompat jauh akan mempengaruhi tolakan kaki dan hasil lompatan sehingga awal lompatanjauh sebaiknya .....</p>', 1, '<p>lari dengan kecepatan sedang kem udian cepat</p>', '<p>lari cepat setelah mendekati tumpuan kecepatan kecepatan dikurangi</p>', '<p>berlari dengan cepat dengan irama yang tetap sampai kebalok tumpuan</p>', '<p>lari dengan kecepatan sedang dari awal sampai balok tumpuan</p>', '<p>berlari dengancepat kemudian berhenti sejenak saat mendekati balok tumpuan</p>', 'C', '', '', '', '', '', '', ''),
(183, 22, 29, '<p>Sebelum melakukan latihan sebaiknya melakukan streching / peregangan terlebih dahulu karena fungsi streching/peregangan sebelum melakukan latihan selain untuk mencegah terjadinya cedera adalah untuk .....</p>', 1, '<p>melenturkan otot dan sendi</p>', '<p>agar suhu tubuh menjadi panas</p>', '<p>mengkondisikan agar tubuh bugar</p>', '<p>menjaga tubuh agar tidak cepat letih</p>', '<p>memiliki daya tahan ketika melakukan aktivitas yang lama</p>', 'A', '', '', '', '', '', '', ''),
(184, 22, 30, '<p>Latihan kebugaran jasmani bertujuan untuk, kecuali&hellip;..</p>', 1, '<p>Agar enak makan</p>', '<p>Mempertahankan kelenturan tubuh</p>', '<p>Menjaga kesehatan tubuh</p>', '<p>Menjaga kebugaran</p>', '<p>Meningkatkan daya tahan tubuh</p>', 'A', '', '', '', '', '', '', ''),
(185, 22, 31, '<p>Latihan kebugaran untuk latihan otot pinggang disebut&hellip;..</p>', 1, '<p>Push up</p>', '<p>Back up</p>', '<p>Shuttle run</p>', '<p>Sit up</p>', '<p>Pull up</p>', 'B', '', '', '', '', '', '', ''),
(186, 22, 32, '<p>Latihan kelincahan disebut juga dengan istilah&hellip;..</p>', 1, '<p>Fleksibility</p>', '<p>Agility</p>', '<p>Speed</p>', '<p>Strength</p>', '<p>Balance</p>', 'B', '', '', '', '', '', '', ''),
(187, 22, 33, '<p>Letakan tangan selebar bahu jari-jari dan ibu jari membentuk huruf V terbalik. Hal ini merupakan start jongkok aba-aba&hellip;..</p>', 1, '<p>persiapan awal</p>', '<p>bersedia</p>', '<p>siap</p>', '<p>gerakan lari</p>', '<p>start berdiri</p>', 'B', '', '', '', '', '', '', ''),
(188, 22, 34, '<p>Suatu bentuk latihan fisik untuk meningkatkan kemampuan dalam hai ini kecepatan (speed) sangat berpariasi, seperti tersebut dibawah ini yang salah satunya adalah ....</p>', 1, '<p>lari lintas alam</p>', '<p>circuit training</p>', '<p>lari bolak balik atau shuttle run</p>', '<p>lari cross country naik turun bukit</p>', '<p>lari dengan durasi waktu yang cukup lama</p>', 'C', '', '', '', '', '', '', ''),
(189, 22, 35, '<p>Tujuan lompat jauh adalah&hellip;</p>', 1, '<p>mencapai lompatan yang sejauh-jauhnya</p>', '<p>mencapai lompatan yang setinggi-tingginya</p>', '<p>mencapai garis finish dengan cepat</p>', '<p>menggunakan pendaratan dua kaki bersama-sama</p>', '<p>mencapai jangkauan gerak yang baik</p>', 'A', '', '', '', '', '', '', ''),
(190, 22, 36, '<p>Lari awalan dalam lompat jauh akan mempengaruhi tolakan kaki dan hasil lompatan sehingga awal lompatanjauh sebaiknya ....</p>', 1, '<p>lari dengan kecepatan sedang kem udian cepat</p>', '<p>berlari dengan cepat dengan irama yang tetap sampai kebalok tumpuan</p>', '<p>lari cepat setelah mendekati tumpuan kecepatan kecepatan dikurangi</p>', '<p>berlari dengan cepat kemudian berhenti sejenak saat mendekati balok tumpuan</p>', '<p>lari dengan kecepatan sedang dari awal sampai balok tumpuan</p>', 'B', '', '', '', '', '', '', ''),
(191, 22, 37, '<p>lari estafet atau lari sambung (lari beranting) adalah lari beregu yang terdiri atas &hellip;. orang dalam satu regu.</p>', 1, '<p>Tiga</p>', '<p>Empat</p>', '<p>Lima</p>', '<p>Enam</p>', '<p>Tujuh</p>', 'B', '', '', '', '', '', '', ''),
(192, 22, 38, '<p>Pada lari sambung atau estafet, start yang digunakan untuk pelari pertama adalah start&hellip;.</p>', 1, '<p>Jongkok</p>', '<p>Melayang</p>', '<p>Berdiri</p>', '<p>Jongkok pendek</p>', '<p>Jongkok panjang</p>', 'A', '', '', '', '', '', '', ''),
(193, 22, 39, '<p>Panjang tongkat yang digunakan untuk lari estafet adalah &hellip;.</p>', 1, '<p>20 cm</p>', '<p>25 cm</p>', '<p>30 cm</p>', '<p>35 cm</p>', '<p>40 cm</p>', 'C', '', '', '', '', '', '', ''),
(194, 22, 40, '<p>Dalam permainan bulu tangkis pukulan dengan tujuan untuk menempatkan bola sedekat mungkin dengan net dan secara cepat pada lapangan lawan adalah pukulan &hellip;.</p>', 1, '<p>Servis</p>', '<p>Lob</p>', '<p>Drive</p>', '<p>Dropshot</p>', '<p>Smash</p>', 'D', '', '', '', '', '', '', ''),
