(213, 14, 19, '<p>Negasi dari &rdquo;Jika saya lulus ujian maka saya kuliah&rdquo; adalah ...</p>', 1, '<p>Saya lulus ujian atau saya tidak kuliah.</p>', '<p>Saya lulus ujian atau saya bekerja.</p>', '<p>Saya lulus ujian tetapi saya tidak kuliah.&nbsp;&nbsp;</p>', '<p>Saya lulus ujian tetapi saya tidak bekerja.</p>', '<p>Saya tidak lulus ujian dan saya bekerja.</p>', 'C', '', '', '', '', '', '', ''),
(214, 14, 20, '<p>Negasi dari pernyataan &rdquo;Jika 2 x 3 = 6 maka 2 + 3 &gt; 5&rdquo; adalah ...</p>', 1, '<p>2 x 3 = 6 dan 2 + 3 &lt; 5.</p>', '<p>2 x 3 6 dan 2 + 3 &nbsp;</p>', '<p>2 x 3 = 6 dan 2 + 3 &nbsp;5.&nbsp;&nbsp;&nbsp;</p>', '<p>Jika 2 x 3 6 maka 2 x 3 &lt; 5.</p>', '<p>Jika 2 + 3 5 maka 2 x 3 &nbsp;</p>', 'C', '', '', '', '', '', '', ''),
(215, 14, 21, '<p>Kontraposisi dari &rdquo;Jika ia sebagai tersangka maka ia diduga bersalah&rdquo; adalah ...</p>', 1, '<p>Jika ia diduga bersalah maka ia sebagai tersangka.</p>', '<p>Jika ia diduga tidak bersalah maka ia bukan tersangka.&nbsp;&nbsp;</p>', '<p>Jika ia bukan tersangka maka ia tidak bersalah.</p>', '<p>Jika sebagai tersangka dan ia tidak bersalah</p>', '<p>Ia bersalah dan ia bukan tersangka.</p>', 'B', '', '', '', '', '', '', ''),
(216, 14, 22, '<p>Kontraposisi dari &rdquo;Jika matahari bersinar maka hari tidak hujan&rdquo; adalah ...</p>', 1, '<p>Jika hari tidak hujan maka matahari bersinar.</p>', '<p>Jika matahari tidak bersinar maka hari tidak hujan.</p>', '<p>Jika hari hujan maka matahari tidak bersinar</p>', '<p>Matahari bersinar dan hari tidak hujan.</p>', '<p>Matahari bersinar dan hari hujan.</p>', 'C', '', '', '', '', '', '', ''),
(217, 14, 23, '<p>Diketahui:</p>\r\n<p>Premis 1&nbsp; : Jika guru matematika datang maka semua siswa senang.</p>\r\n<p>Premis 2&nbsp; : Ada siswa tidak senang.</p>\r\n<p>Kesimpulan yang sah dari kedua premis di atas adalah ...</p>', 1, '<p>Ada guru datang.</p>', '<p>Semua siswa senang.</p>', '<p>Guru matematika tidak datang.&nbsp;&nbsp;</p>', '<p>Jika guru matematika tidak datang maka semua siswa tidak senang.</p>', '<p>Jika ada siswa senang maka guru matematika datang.</p>', 'C', '', '', '', '', '', '', ''),
(218, 14, 24, '<p>Diketahui:</p>\r\n<p>Premis 1&nbsp; : Jika bunga itu berwarna putih maka bunga itu melati.</p>\r\n<p>Premis 2&nbsp; : Bunga itu bukan melati.</p>\r\n<p>Kesimpulan yang sah dari kedua premis di atas adalah ...</p>', 1, '<p>Bunga itu tidak berwarna merah</p>', '<p>Bunga itu tidak berwarna putih</p>', '<p>Bunga itu berwarna merah.</p>', '<p>Bunga itu bunga mawar.</p>', '<p>Bunga itu bukan bunga mawar.</p>', 'B', '', '', '', '', '', '', ''),
