(316, 13, 2, '<p><em>Cermatilah teks berikut!</em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"520\">\r\n<p>Polisi tidak berhak menyita kendaraan bermotor atau STNK, kecuali kendaraan bermotor itu diduga hasil tindak pidana, pelanggaran itu mengakibatkan kematian, pengemudi tidak dapat menunjukkan STNK, atau pengemudi tidak dapat menunjukkan SIM.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Kalimat kompleks tersebut dapat diubah menjadi kalimat sederhana, yaitu</p>', 1, '<p>pelanggaran itu mengakibatkan kematian</p>', '<p>pengemudi tidak dapat menunjukkan STNK</p>', '<p>polisi tidak berhak menyita kendaraan bermotor atau STNK</p>', '<p>kendaraan bermotor itu diduga hasil tindak pidana</p>', '<p>kata argumentasi yang berhubungan dengan topik pembahasan</p>', 'C', '', '', '', '', '', '', ''),
