(318, 13, 4, '<p><em>Cermatilah teks prosedur berikut! </em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"520\">\r\n<p><strong>Cara Membuat Lilin Aroma Terapi</strong></p>\r\n<p>Lilin aroma terapi sangat banyak diminati, khususnya bagi anda yang ingin mengharumkan kamar dengan wangi bahan atau bunga alami yang menenangkan. Selain banyak dijual, lilin aroma terapi juga bisa menjadi lahan bisnis. Berikut ini cara membuat lilin aroma terapi yang bisa dipraktikkan di rumah.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Penggalan teks di atas merupakan salah satu struktur prosedur, yaitu bagian</p>', 1, '<p>tujuan</p>', '<p>langka-langkah</p>', '<p>imperatif</p>', '<p>deklaratif</p>', '<p>eksposisi</p>', 'A', '', '', '', '', '', '', ''),
(319, 13, 5, '<p><em>Cermatilah teks prosedur berikut!</em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"520\">\r\n<p>1. Untuk mematikan komputer, anda dapat mengeklik tombol <em>start.</em></p>\r\n<p>2. Kemudian pilih <em>shutdown.</em></p>\r\n<p>3. Dengan menekan <em>shutdown, </em>komputer akan mati secara otomatis.</p>\r\n<p>4. Setelah program komputer hilang, tekanlah tombel <em>power </em>pada layar monitor dan <em>stabilizer</em> saluran listrik</p>\r\n<p>5. Cabutlah steker listrik ke komputer untuk mengakhiri proses operasi komputer</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Kalimat yang menggunakan konjungsi kronologis ditunjukkan pada nomor</p>', 1, '<p>3 dan 5</p>', '<p>1 dan 3</p>', '<p>2 dan 4</p>', '<p>5 dan 1</p>', '<p>5 dan 4</p>', 'C', '', '', '', '', '', '', ''),
(320, 13, 6, '<p><em>Cermatilah teks berikut!</em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"482\">\r\n<p>Tanaman selada sebenarnya tahan dalam keadaan segar selama beberapa waktu. Dengan catatan, pada saat menyimpan sebaiknya di tempat yang dingin. Caranya tempat itu ditaburi butiran es atau remukan es.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Pernyataan diatas adalah tahap kegiatan yang disebut</p>', 1, '<p>pembersihan</p>', '<p>penyimpanan</p>', '<p>&nbsp;pengemasan</p>', '<p>pemasaran</p>', '<p>orang tua dan anak</p>', 'B', '', '', '', '', '', '', ''),
(321, 13, 7, '<p><em>Cermati kutipan berikut!</em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"501\">\r\n<p>Bahan : rimpang kencur sebesar ibu jari, garam secukupnya</p>\r\n<p>Cara membuat : kencur diparut. Tambahkan secangkir air hangat. lalu peras dan disaring. Kencur yang telah disaring biar mengendap, beri garam secukupnya kemudian diminum.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Kata yang menunjukan urutan kegiatan adalah</p>', 1, '<p>&nbsp;kemudian</p>', '<p>secangkir air</p>', '<p>tambahkan</p>', '<p>biar mengendap</p>', '<p>orientasi</p>', 'C', '', '', '', '', '', '', ''),
(322, 13, 8, '<p>Kalimat dalam teks prosedur tidak membingungkan dan mudah diikuti berarti kalimat tersebut....</p>', 1, '<p>logis</p>', '<p>jelas</p>', '<p>baku</p>', '<p>singkat</p>', '<p>padat</p>', 'A', '', '', '', '', '', '', ''),
(323, 13, 9, '<p><em>Perhatikan kutipan berikut!</em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"520\">\r\n<p>Makanan alami lele terdiri dari plankton, berbagai udang kecil, siput, cacing, jentik nyamuk, bahkan sisa sayur-mayur. Jika ele dibudidayakan di kolam, sisa-sisa masakan di dapur, dadak halus dapat ditambahkan sebagai makanan tambahan. Oleh karena itu, lele disebut pula sebagai omnivore atau pemakan segala.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Konjungsi antarkalimat dalam kutipan tersebut adalah</p>', 1, '<p>maka</p>', '<p>oleh karena itu</p>', '<p>sebagai</p>', '<p>terdiri dari</p>', '<p>karena</p>', 'B', '', '', '', '', '', '', ''),
(324, 13, 10, '<p>Berikut yang bukan merupakan contoh dari konjungsi temporal adalah...</p>', 1, '<p>kemudian</p>', '<p>selanjutnya</p>', '<p>mengapa</p>', '<p>apabila</p>', '<p>daripada</p>', 'C', '', '', '', '', '', '', ''),
