(329, 13, 15, '<p>Kalimat deklaratif terdapat pada kalimat dibawah ini, yaitu...</p>', 1, '<p>jus mangga siap untuk disajikan</p>', '<p>kupas buah mangga lalu cuci dengan air bersih</p>', '<p>saring buah mangga dan sajikan di gelas saji</p>', '<p>haluskan potongan buah mangga dengan blender bersama air</p>', '<p>kalimat yang hilang dari jawaban</p>', 'A', '', '', '', '', '', '', ''),
(330, 13, 16, '<p><em>Bacalah teks eksplanasi berikut :</em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"548\">\r\n<p>(1) Dengan tenaga yang besar dalam gelombang air tersebut, sangat wajar jika bangunan di daratan bisa tersapu dengan mudah. (2) Gelombang tsunami ini merambat dengan kecepatan yang tak terbayangkan. (3) gelombang tersebut bisa mencapai 500 sampai 1.000 kilometer per jam di lautan. (4) Pada saat mencapai bibir pantai, kecepatannya berkurang menjadi 50 sampai 30 kilometer. (5) Meskipun berkurang pesat, kecepatan tersebut sudah bisa menyebabkan kerusakan yang parah.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Kalimat yeng merupakan pendapat dinyatakan pada nomor</p>', 1, '<p>(1) dan (2)</p>', '<p>(2) dan (3)</p>', '<p>(3) dan (4)</p>', '<p>(4) dan (5)</p>', '<p>&nbsp;(1) dan (5)</p>', 'A', '', '', '', '', '', '', ''),
(331, 13, 17, '<p><em>Bacalah teks eksplanasi berikut :</em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"548\">\r\n<p>Bahasa Indonesia yang digunakan sekarang berasal dari bahasa Melayu. Bahasa tersebut sejak lama digunakan sebagai bahasa perantara (lingua franca) atau bahasa pergaulan. Tidak hanya digunakan di kepulauan Nusantara, tetapi juga digunakan hampir di seluruh Asia tenggara. Hal ini diperkuat dengan ditemukannya prasasti-prasasti kuno yang ditulis dengan menggunakan bahasa Melayu.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Teks eksplanasi di atas menuangkan pengetahuan tentang masalah/fenomena</p>', 1, '<p>&nbsp;agama</p>', '<p>sosial</p>', '<p>budaya</p>', '<p>ekonomi</p>', '<p>alam&nbsp;&nbsp;&nbsp;&nbsp;</p>', 'C', '', '', '', '', '', '', ''),
(332, 13, 18, '<p>Berikut yang bukan termasuk isi dari sebuah teks eksplanasi adalah...</p>', 1, '<p>kesimpulan atau inti sari yang dibahas</p>', '<p>informasi berdasarkan fakta</p>', '<p>pernyataan tentang topik yang dibahas</p>', '<p>konflik pada tokoh novel</p>', '<p>pendahuluan, isi, penutup</p>', 'D', '', '', '', '', '', '', ''),
(333, 13, 19, '<p><em>Bacalah teks eksplanasi berikut :</em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"548\">\r\n<p>Bahasa Indonesia yang digunakan sekarang berasal dari bahasa Melayu. Bahasa tersebut sejak lama digunakan sebagai bahasa perantara (lingua franca) atau bahasa pergaulan. Tidak hanya digunakan di kepulauan Nusantara, tetapi juga digunakan hampir di seluruh Asia tenggara. Hal ini diperkuat dengan ditemukannya prasasti-prasasti kuno yang ditulis dengan menggunakan bahasa Melayu.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Pernyataan yang sesuai dengan teks di atas adalah</p>', 1, '<p>Bahasa Indonesia adalah bahasa Melayu</p>', '<p>Bahasa Indonesia sejak lama digunakan sebagai bahasa perantara atau bahasa pergaulan</p>', '<p>Bahasa Indonesia digunakan hampir di seluruh Asia Tenggara</p>', '<p>Ditemukannya prasasti-prasasti kuno yang ditulis dengan menggunakan bahasa</p>', '<p>Bahasa literasi</p>', 'D', '', '', '', '', '', '', ''),
(334, 13, 20, '<p>Kalimat yang menggunakan majas metafora adalah...</p>', 1, '<p>Pena menari-nari diatas kertas.</p>', '<p>Dewi malam bersembunyi dibalik awan.</p>', '<p>Halilintar bersahut-sahutan ditengah derasnya hujan.</p>', '<p>Harimau mengaung memecahkan keheningan malam</p>', '<p>Hubungan antara jasa orang tua</p>', 'C', '', '', '', '', '', '', ''),
(335, 13, 21, '<p>Tikungan itu telah menelan beberapa nyawa</p>\r\n<p>Kalimat yang menggunakan majas yang sama dengan kalimat tersebut adalah...</p>', 1, '<p>Putri selalu diantar dengan kijang berwarna merah</p>', '<p>Suaranya menggeledek seperti petir di siang hari.</p>', '<p>Tony menyaksikan peristiwa itu dengan mata kepalanya sendiri.</p>', '<p>Bel telah memanggil anak-anak masuk ke kelas.</p>', '<p>Rakyat Indonesia</p>', 'D', '', '', '', '', '', '', ''),
(336, 13, 22, '<p><em>Bacalah teks</em><em> eksplanasi berikut </em><em>:</em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"529\">\r\n<p>Teks tersebut terdiri dari pendahuluan dan rincian-rincian tentang sebab terjadinya gempa bumi. Bagian pendahuluan terdiri atas tiga paragraf&nbsp; yang berisi pengertian gempa bumi dan jenis-jenisnya. Bagian perincian terdiri atas lima paragraf. Paragraf pertama membahas &hellip;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Teks diatas adalah penilaian hasil analisis teks eksplanasi bagian</p>', 1, '<p>kaidah</p>', '<p>bahasa</p>', '<p>struktur</p>', '<p>kesimpulan</p>', '<p>penutup</p>', 'C', '', '', '', '', '', '', ''),
(337, 13, 23, '<p>Kalimat pernyataan umum yang tepat untuk teks eksplanasi tentang kekeringan, yaitu</p>', 1, '<p>bencana kekeringan sudah terjadi dimana-mana</p>', '<p>kekeringan menyebabkan kebakaran</p>', '<p>kekeringan merupakan salah satu fenomena alam ketika musim kering terjadi dalam waktu yang cukup lama</p>', '<p>kekeringan diakibatkan ketiadaan air dalam waktu yang cukup lama</p>', '<p>Yang terhormat ibu dan bapak</p>', 'C', '', '', '', '', '', '', ''),
(338, 13, 24, '<p><em>Bacalah teks</em><em> eksplanasi berikut </em><em>:</em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"529\">\r\n<p>Gempa yang terjadi dalam perut bumi akan mengakibatkan munculnya tekanan ke arah vertikal sehingga dasar lautan akan naik dan turun dalam rentang waktu yang singkat. Hal ini kemudian akan memicu ketidakseimbangan pada air lautan yang kemudian terdorong menjadi gelombang besar mencapai wilayah daratan.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Isi teks eksplanasi tersebut adalah</p>', 1, '<p>proses terjadinya gelombang laut</p>', '<p>penyebab terjadinya tsunami</p>', '<p>penyebab gempa</p>', '<p>akibat terjadinya gempa</p>', '<p>sebab akibat</p>', 'B', '', '', '', '', '', '', ''),
(339, 13, 25, '<p>Tujuan ceramah adalah...</p>', 1, '<p>memberikan nasehat</p>', '<p>mendeskripsikan sesuatu</p>', '<p>menyimpulkan tujuan</p>', '<p>mengembangkan paragraf</p>', '<p>menjelaskan fenomena</p>', 'A', '', '', '', '', '', '', ''),
(340, 13, 26, '<p>Isi dalam penutup penyampaian ceramah berupa</p>', 1, '<p>salam pembuka&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>pengenalan topik, tema, dan judul</p>', '<p>kesimpulan dan ungkapan penutup</p>', '<p>materi pokok yang dibahas</p>', '<p>penutup</p>', 'C', '', '', '', '', '', '', ''),
