(342, 13, 28, '<p>Suatu metode dalam ceramah yang serta merta tanpa persiapan terlebih dahulu disebut</p>', 1, '<p>impromptu</p>', '<p>memoriter</p>', '<p>naskah</p>', '<p>&nbsp;ekstemporan</p>', '<p>konjungsi</p>', 'A', '', '', '', '', '', '', ''),
(343, 13, 29, '<p>Pekerjaan kakaknya adalah sebagai <strong><em>kuli tinta</em></strong>.</p>\r\n<p>Makna ungkapan <strong><em>kuli tinta</em></strong> pada kalimat tersebut adalah</p>', 1, '<p>wartawan</p>', '<p>penjual tinta</p>', '<p>penulis buku</p>', '<p>sekertaris</p>', '<p>bendahara</p>', 'A', '', '', '', '', '', '', ''),
(344, 13, 30, '<p><em>Perhatikan teks berikut!</em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"520\">\r\n<p>Seseorang yang suka mengabaikan atau menunda-nunda pekerjaannya padahal waktu yang tersedia cukup banyak. Tetapi, setelah diketahui manfaat dan keuntungan dari pekerjaan tersebut, barulah dia memulai mengerjakannya. Namun waktu, pengerjaannya tinggal sedikit.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Peribahasa yang sesuai dengan ilustrasi diatas adalah</p>', 1, '<p>Mulutmu harimaumu yang akan menerkam kepalamu</p>', '<p>Hari pagi dibuang-buang, hari petang dikejar-kejar</p>', '<p>Hilang tak tentu rimbanya, mati tak tentu kuburnya</p>', '<p>Ikut hati mati, ikut rasa binasa, ikut mata buta</p>', '<p>jumlah halaman</p>', 'B', '', '', '', '', '', '', ''),
