(346, 13, 32, '<p><em>Bacalah teks berikut!</em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"520\">\r\n<p>Segala puji kita panjatkan kehadirat Allah swt. Atas segala nikmat-Nya yang telah diberikan kepada kita semua. Nikmat sehat, nikmat taufik hidayah inayah, dan nikmat yang paling besar adalah nikmat iman dan islam. Salawat serta salam tak lupa kita sanjungkan keharibaan nabi besar Muhammad saw.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Teks di atas termasuk pendahuluan yang berupa</p>', 1, '<p>salam pembuka</p>', '<p>ungkapan terimakasih</p>', '<p>judul</p>', '<p>tema</p>', '<p>editor</p>', 'B', '', '', '', '', '', '', ''),
