(353, 13, 39, '<p><em>Bacalah kutipan teks berikut!</em></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"595\">\r\n<p>Keberhasilan kita hari ini dan hari kemarin merupakan keberhasilan guru dan kedua orang tua kita yang dengan susah payah telah membesarkan dan membimbing kita, sehingga kita bisa meraih apa yang kita miliki hari ini. Pendidikan yang mereka ajarkan kepada kita, sungguh sangat berarti. Darah mereka yang mengalir di tubuh kita. Menjadi penguat dan penyegar hidup kita. Kasih sayang yang mereka tumpahkan, telah menjadi butiran-butiran mutiara yang tak ternilai harganya.</p>\r\n<p>Kepadamu ya tuhan, beri kami kesempatan untuk berbakti kepada orang tua dan guru-guru kami. Berikan kami keberanian untuk bersimpuh dipangkuannya, untuk meminta maaf dan do&rsquo;a ibu dan Bapak.</p>\r\n<p>Bapak ibu guru dan hadirin yang saya cintai inilah yang saya bisa ungkapan, semoga bermanfaat bagi kita sekalian. Mohon maaf bila ada kesalahan.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Inti dari kutipan teks di atas adalah</p>', 1, '<p>mengenal perjuangan orang tua</p>', '<p>mengenang jasa orang tua</p>', '<p>berbakti kepada orang tua</p>', '<p>kebaikan orang tua</p>', '<p>keadilan</p>', 'C', '', '', '', '', '', '', ''),
