(395, 16, 1, '<p>Ditinjau secara etimologi istilah <em>demokrasi</em> berasal dari Bahasa <strong>Yunani</strong> <em>demos</em> dan <em>cratein</em>, yang berarti&hellip;.&nbsp;</p>', 1, '<p>pemerintahan oleh kaum bangsawan</p>', '<p>pemerintahan oleh golongan cendekiawan</p>', '<p>pemerintahan rakyat</p>', '<p>raja yang menjalankan pemerintahan</p>', '<p>rakyat dan borjuis</p>', 'C', '', '', '', '', '', '', ''),
(396, 16, 2, '<p>Pemerintahan dari rakyat, oleh rakyat dan untuk rakyat adalah pengertian <em>demokrasi</em> menurut pendapat&hellip;</p>', 1, '<p>Kranenburg</p>', '<p>Abraham Lincoln</p>', '<p>Jhon Locke</p>', '<p>Grotius</p>', '<p>Logeman</p>', 'B', '', '', '', '', '', '', ''),
(397, 16, 3, '<p>Lahirnya sistem pemerintahan demokrasi di Indonesia bertujuan untuk&hellip;</p>', 1, '<p>membatasi kekuasaan Negara</p>', '<p>membatasi kekuasaan raja</p>', '<p>mengikutsertakan parpol dalam urusan pemerintahan</p>', '<p>mengikutsertakan rakyat dalam pemerintahan</p>', '<p>membatasi keikutsertaan rakyat dalam pemerintahan</p>', 'D', '', '', '', '', '', '', ''),
(398, 16, 4, '<p>Alasan banyak negara yang berupaya menerapkan bentuk pemerintahan demokrasi adalah.....</p>', 1, '<p>agar tidak dikucilkan oleh Negara lain</p>', '<p>untuk menghindari kekacauan politik</p>', '<p>tuntutan dari Negara maju</p>', '<p>hal yang paling menguntungkan negara</p>', '<p>demokrasi lebih memihak kepada kepentingan rakyat</p>', 'E', '', '', '', '', '', '', ''),
(399, 16, 5, '<p>Sistem kepartaian yang dijalankan pada masa demokrasi liberal adalah multi partai. Pembentukan sistem ini menurut Moh. Hatta mempunyai tujuan&hellip;</p>', 1, '<p>untuk mempercepat pelaksana demokrasi di Indonesia</p>', '<p>semakin banyak partai politik semakin besar untuk mencapai tujuan Indonesia yang berbangsa dan bernegara</p>', '<p>mengukur kekuatan perjuangan dan untuk mempermudah dalam hal meminta tanggung jawab kepada pemimpin-pemimpin barisan perjuangan</p>', '<p>Sebagai barometer keikutsertaan rakyat dalam bidang politik</p>', '<p>untuk lebih menyalurkan suara masyarakat Indonesia yang beragam sesuai dengan pilihan perjuangannya</p>', 'B', '', '', '', '', '', '', ''),
(400, 16, 6, '<p>Dalam rangka menegakkan demokrasi Pancasila yang dapat disumbangkan oleh para pelajar adalah&hellip;.</p>', 1, '<p>setiap masalah hendaknya diselesaikan setelah peristiwa berulang</p>', '<p>karena perlu dilakukan setelah musyawarah mengalami kegagalan</p>', '<p>mengadakan corat coret sebagai tanda unjuk rasa pelajar</p>', '<p>menciptakan solusi dalam pemecahan setiap masalah</p>', '<p>menyelesaikan persoalan melalui musyawarah kelas tanpa kekerasan</p>', 'E', '', '', '', '', '', '', ''),
(401, 16, 7, '<p>Pada hakekatnya, prinsip sistem pemerintahan parlementer merupakan&hellip;</p>', 1, '<p>intisari kebiasaan ketatanegaraan di kerajaan Inggris</p>', '<p>hasil pemikiran dan intisari kebiasaan para pembentuk ketatanegaraan konstitusi kerajaan Inggris</p>', '<p>hasil pemikiran para pembentuk konstitusi kerajaan Inggris</p>', '<p>intisari kebiasaan ketatanegaraan di Negara AS</p>', '<p>mayoritas yang ingin dilakukan oleh setiap negara</p>', 'B', '', '', '', '', '', '', ''),
(402, 16, 8, '<p>Demokrasi yang diterapkan di Indonesia saat ini adalah demokrasi yang&hellip;</p>', 1, '<p>diwariskan oleh Belanda</p>', '<p>bersumber kepada kepribadian bangsa Indonesia, yaitu Pancasila</p>', '<p>sama dengan demokrasi dinegara berkembang lainnya</p>', '<p>merupakan perpaduan demokrasi liberalis dan sosialis</p>', '<p>bersumber pada kearifan local budaya</p>', 'B', '', '', '', '', '', '', ''),
(403, 16, 9, '<p>Pada masa demokrasi terpimpin, pengaruh PKI semakin menguat dan menjadi salah satu kekuatan besar pada saat itu. Faktor penyebabnya adalah&hellip;</p>', 1, '<p>paham komunis yang searah dengan keinginan rakyat</p>', '<p>propaganda PKI yang berhasil merebut perhatian rakyat</p>', '<p>Soekarno menyatakan diri sebagai salah satu kader komunis</p>', '<p>sinergitas Antara komunis dan TNI</p>', '<p>pengaruh yang besar dari penguasa pemerintahan pada saat itu</p>', 'B', '', '', '', '', '', '', ''),
(404, 16, 10, '<p>Suatu Negara disebut sebagai <em>Negara demokratis</em> apabila di dalam pemerintahan terjadi hal-hal berikut, <strong>kecuali&hellip;</strong>.</p>', 1, '<p>tidak terjadi distribusi pendapatan yang adil</p>', '<p>rakyat memiliki persamaan didepan hukum</p>', '<p>rakyat berkesempatan untuk ikut serta dalam pembuatan keputusan</p>', '<p>rakyat memperoleh pendapatan yang layak</p>', '<p>rakyat memiliki kekuatan dalam meningkatkan perekonomian</p>', 'A', '', '', '', '', '', '', ''),
(405, 16, 11, '<p>Perhatikan pernyataan berikut!</p>\r\n<p>(1) Memberikan penghargaan terhadap orang yang taat pada peraturan</p>\r\n<p>(2) Memberikan sanksi hukum yang berat bagi yang melanggar hukum</p>\r\n<p>(3) Meningkatkan pembinaan kesadaran hukum</p>\r\n<p>(4) Mengoptimalkan peran lembaga-lembaga Negara selain lembaga tinggi Negara</p>\r\n<p>(5) Supremasi hukum dan demokrasi harus ditegakkan</p>\r\n<p>(6) Meningkatkan kualitas pelayanan publik</p>\r\n<p>(7) Melakukan penanganan terhadap kasus-kasus yang berkaitan dengan gerakan separatis</p>\r\n<p>Upaya-upaya yang dilakukan oleh pemerintah untuk mencegah pelanggaran hak dan pengingkaran kewajiban warga Negara terdapat pada nomor</p>', 1, '<p>(1), (2), (3), (4) dan (5)</p>', '<p>(1), (2), (3), (5) dan (6)</p>', '<p>(1), (3), (4), (5) dan (6)</p>', '<p>(2), (3), (4), (5) dan (7)</p>', '<p>(2), (3), (4), (6), dan (7)</p>', 'A', '', '', '', '', '', '', ''),
(406, 16, 12, '<p>Banyak sedikitnya lapangan kerja yang tersedia dapat dipengaruhi oleh&hellip;.</p>', 1, '<p>tinggi rendahnya jiwa berwirausaha</p>', '<p>banyak sedikitnya jumlah angkatan kerja</p>', '<p>kurangnya lembaga latihan kerja</p>', '<p>banyak sedikitnya sumber daya alam</p>', '<p>daya minat masyarakat dalam lapangan kerja</p>', 'A', '', '', '', '', '', '', ''),
(407, 16, 13, '<p>Penawaran tenaga kerja sangat tergantung dari&hellip;.</p>', 1, '<p>mobilitas tenaga kerja</p>', '<p>tingkat upah yang berlaku</p>', '<p>sosial ekonomi pekerja</p>', '<p>jumlah tenaga kerja</p>', '<p>banyaknya jumlah pencari kerja</p>', 'B', '', '', '', '', '', '', ''),
(408, 16, 14, '<p><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Imbalan dasar yang dibayarkan kepada pekerja menurut tingkat atau jenis pekerja yang besarnya ditetapkan berdasarkan kesepakatan disebut&hellip;.</span></p>', 1, '<p>tunjangan tidak tetap</p>', '<p>upah pokok</p>', '<p>tunjangan tetap</p>', '<p>honorarium</p>', '<p>gaji</p>', 'D', '', '', '', '', '', '', ''),
(409, 16, 15, '<p>Bila ada serikat pekerja yang tidak terwakili dalam tim perundingan, maka&hellip;</p>', 1, '<p>serikat pekerja menyampaikan aspirasinya sebelum dimulai perundingan pembuatan perjanjian</p>', '<p>serikat pekerja melakukan musyawarah sebelum dimulai perundingan pembuatan perjanjian</p>', '<p>serikat pekerja melakukan pemungutan suara sebelum dimulai perundingan pembuatan perjanjian</p>', '<p>serikat pekerja bisa menyampaikan aspirasinya melalui team kuasa hukumnya</p>', '<p>serikat pekerja melakukan koalisi sebelum dimulai perundingan peraturan perjanjian</p>', 'E', '', '', '', '', '', '', ''),
(410, 16, 16, '<p>Masalah utama pembangunan ekonomi di negara berkembang adalah&hellip;.</p>', 1, '<p>kemiskinan, kebodohan, dan keterbelakangan</p>', '<p>pengangguran, kemiskinan, dan ketimpangan dalam distribusi pendapatan</p>', '<p>kemiskinan dan pengangguran</p>', '<p>kemiskinan, ketimpangan pendapatan, dan rusak lingkungan</p>', '<p>kemiskinan, pengangguran, daya minat bekerja kecil</p>', 'B', '', '', '', '', '', '', ''),
(411, 16, 17, '<p>Akibat kesalahan pekerja yang bekerja tidak berdasarkan prosedur keselamatan kerja, ketika terjadi kecelakaan yang mengakibatkan luka parah. Sikap pengusaha adalah&hellip;</p>', 1, '<p>wajib membuktikan bahwa pengusaha tidak bersalah karena telah memenuhi prosedur</p>', '<p>pengusaha wajib memberi ganti rugi (tunjangan) kepada istri atau suami pekerja yang meninggal</p>', '<p>mempersiapkan sarana keselamatan kerja sesuai ketentuan yang berlaku</p>', '<p>tidak wajib memberikan ganti kerugian</p>', '<p>menanggung seluruh biaya perawatan sampai pekerja sembuh</p>', 'B', '', '', '', '', '', '', ''),
(412, 16, 18, '<p>Organisasi yang dibentuk dari, oleh dan untuk pekerja yang bersifat bebas, terbuka, mandiri, demokrasi, dan bertanggung jawab guna memperjuangkan, membela, serta melindungi hak dan kepentingan pekerja serta meningkatkan kesejahteraan pekerjaan dan keluarganya adalah&hellip;</p>', 1, '<p>badan pekerja</p>', '<p>organisasi buruh</p>', '<p>serikat pekerja</p>', '<p>koperasi buruh</p>', '<p>organisasi pekerja</p>', 'C', '', '', '', '', '', '', ''),
(413, 16, 19, '<p>Hakikat subjek hukum internasional adalah&hellip;.</p>', 1, '<p>pemegang hak dan kewajiban internasional</p>', '<p>Negara-negara yang tergabung dalam PBB</p>', '<p>pihak-pihak yang mengalami sengketa</p>', '<p>pokok-pokok yang mengadakan perjanjian</p>', '<p>orang perorangan yang bisa melakukan kerjasama</p>', 'B', '', '', '', '', '', '', ''),
