(415, 16, 21, '<p><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Kekuatan mengikat hukum internasional dibanding hukum nasional adalah</span></p>', 1, '<p>hukum internasional lebih kuat karena sanksinya lebih kuat</p>', '<p>relative sama karena kedua hukum tersebut telah diterima masyarakat</p>', '<p>hukum nasional hanya berlaku dalam Negara tertentu, sedangkan hokum internasional berlaku dinegara seluruh dunia</p>', '<p>hukum nasional lebih kuat karena didukung alat-alat penegak hukum yang memiliki kekuasaan dan kewenangan untuk menegakkan hokum tersebut</p>', '<p>hukum nasional lebih mengikat kepada Negara yang melakukan perjanjian</p>', 'C', '', '', '', '', '', '', ''),
