(419, 16, 25, '<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif;\">Keputusan lembaga internasional pada dasarnya mengikat seluruh Negara karena&hellip;</span></p>', 1, '<p>tidak dapat diganggu gugat</p>', '<p>dihasilkan berdasarkan perjanjian internasional</p>', '<p>tujuan keputusan tersebut untuk kepentingan bangsa-bangsa didunia</p>', '<p>dijadikan pedoman untuk masyarakat internasional</p>', '<p>harus diterima apapun alasannya</p>', 'A', '', '', '', '', '', '', ''),
(420, 16, 26, '<p>Apabila voting yang dilakukan dalam sidang mahkamah Internasional hasilnya sama, pengambilan keputusan ditempuh dengan cara&hellip;.</p>', 1, '<p>voting diulang sekali lagi</p>', '<p>keputusan ditunda menunggu adanya bukti baru</p>', '<p>perkara diserahkan kepada Sekjen PBB</p>', '<p>perkara diserahkan kembali kepada pihak yang berperkara</p>', '<p>dilakukan dengan jalan lain yaitu kesepakatan pihak yang bersengketa</p>', 'C', '', '', '', '', '', '', ''),
(421, 16, 27, '<p><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Berikut perbuatan yang dapat menyebabkan seseorang dituntut dalam pengadilan internasional, kecuali&hellip;</span></p>', 1, '<p>kejahatan perang</p>', '<p>mendapatkan penghargaan</p>', '<p>kejahatan terhadap perdamaian</p>', '<p>kejahatan terhadap kemanusiaan</p>', '<p>mengadu domba antar bangsa</p>', 'D', '', '', '', '', '', '', ''),
(422, 16, 28, '<p><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Salah satu dampak Negara yang tidak mematuhi keputusan Mahkamah Internasional dapat dikenakan <em>travel warning</em>, artinya&hellip;.</span></p>', 1, '<p>embargo ekonomi</p>', '<p>pengalihan investasi</p>', '<p>pemutusan hubungan diplomati</p>', '<p>peringatan bahaya berkunjung ke suatu Negara</p>', '<p>blockade untuk tidak bepergian ke luar negeri</p>', 'D', '', '', '', '', '', '', ''),
(423, 16, 29, '<p>Mahkamah Internasional, dibentuk berdasarkan&hellip;</p>', 1, '<p>perjanjian internasional</p>', '<p>kepentingan internasional</p>', '<p>permufakatan Negara-negara didunia</p>', '<p>hasil sidang Majelis Umum PBB</p>', '<p>Usulan Negara anggota tetap Dewan Keamanan PBB</p>', 'E', '', '', '', '', '', '', ''),
(424, 16, 30, '<p>Apabila ada pihak yang berperkara merasa dirugikan terhadap keputusan Mahkamah Internasional, pihak tersebut dapat menempuh cara&hellip;.</p>', 1, '<p>Kasasi</p>', '<p>Banding</p>', '<p>grasi ke Sekjen PBB</p>', '<p>Mengajukan revisi keputusan</p>', '<p>naik banding ke PBB</p>', 'D', '', '', '', '', '', '', ''),
(425, 16, 31, '<p><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Jaminan pelaksanaan HAM/Hak asasi manusia dari pemerintah terlihat dalam&hellip;</span></p>', 1, '<p>membatasi berlakunya hak-hak pribadi</p>', '<p>memasyarakatkan hal-hal yang belum diketahui oleh masyarakat</p>', '<p>menanamkan kesadaran akan pentingnya hak pribadi</p>', '<p>perlindungan terhadap seseorang yang berperkara</p>', '<p>memberi kebebasan kepada anggota masyarakat untuk melaksanakan kehendaknya</p>', 'E', '', '', '', '', '', '', ''),
(426, 16, 32, '<p>Orde Baru adalah periode kepemimpinan Presiden terlama. Dalam sejarah penyelenggaraan Negara masa Orde Baru terdapat penyimpangan dan keberhasilan yang dicapai. Salah satu bukti keberhasilan pembangunan sektor pertanian masa Orde Baru, yaitu&hellip;</p>', 1, '<p>pembuatan sawah sejuta hectare di Kalimantan</p>', '<p>banyak temuan mengenai varietas unggul</p>', '<p>tak ditemukan hama dan gulma dalam pertanian</p>', '<p>terwujudnya swasembada pangan</p>', '<p>Adanya ekspor pangan</p>', 'D', '', '', '', '', '', '', ''),
(427, 16, 33, '<p>Perbedaan demokrasi Pancasila dibandingkan dengan demokrasi terpimpin salah satunya adalah&hellip;</p>', 1, '<p>demokrasi Pancasila apabila voting tidak tercapai maka keputusan diserahkan kepada pemimpin</p>', '<p>demokrasi terpimpin apabila suara terbanyak tidak tercapai maka keputusan diserahkan kepada pimpinan</p>', '<p>demokrasi Pancasila harus mencapai musyawarah mufakat</p>', '<p>demokrasi Pancasila apabila musyawarah mufakat tidak tercapai maka keputusan diserahkan kepada pimpinan</p>', '<p>demokrasi pancasila harus dilakukan dengan voting</p>', 'C', '', '', '', '', '', '', ''),
(428, 16, 35, '<p>Sistem demokrasi terpimpin pernah diterapkan di Indonesia. Sistem demokrasi terpimpin tidak sejalan dengan prinsip-prinsip demokrasi sebab&hellip;</p>', 1, '<p>partai politik dilarang berdiri</p>', '<p>diangkatnya presiden seumur hidup</p>', '<p>adanya pemusatan kekuasaan Negara pada diri presiden</p>', '<p>anggota-anggota DPR berasal dari wakil partai politik</p>', '<p>adanya banyak berdiri partai politik</p>', 'C', '', '', '', '', '', '', ''),
(429, 16, 34, '<p>Berikut ini yang merupakan kebijakan B.J Habibie untuk memenuhi tuntutan reformasi adalah&hellip;.</p>', 1, '<p>membatasi kebebasan rakyat dalam menyuarakan aspirasinya</p>', '<p>melakukan jejak pendapat terhadap Propinsi Timor Timur dan Nusa Tenggara Timur</p>', '<p>melakukan pencabutan terhadap pembredelan pers</p>', '<p>Membentuk KPK untuk mengusut korupsi Negara</p>', '<p>mencekal orang-orang yang dianggap vocal dalam negara</p>', 'C', '', '', '', '', '', '', ''),
(430, 16, 36, '<p>Salah satu fungsi asas demokrasi adalah sebagai alat untuk membatasi kekuasaan Negara sesuai dengan konstitusi. Diera Reformasi pembatasan dilakukan dengan memberdayakan daerah melalui system desentralisasi. Hal ini bertujuan agar tidak terjadi penyalahgunaan kekuasaan untuk kepentingan pribadi atau golongan. Pembatasan kekuasaan Negara yang dimaksud di atas dilakukan melalui&hellip;</p>', 1, '<p>menyerahkan semua wewenang pada pemerintah pusat</p>', '<p>melakukan pemilihan Presiden secara tidak langsung</p>', '<p>memusatkan kekuasaan pada kepala Negara</p>', '<p>pelaksanaan otonomi daerah</p>', '<p>pemusatan pemerintahan secara sentral</p>', 'D', '', '', '', '', '', '', ''),
(431, 16, 37, '<p>Semua warga Negara sama kedudukannya dalam hukum dan pemerintahan, serta wajib menjunjung hukum dan pemerintahan itu dengan tidak ada kecualinya. Hal ini tercantum dalam UUD NRI 1945 Amandemen pasal&hellip;.</p>', 1, '<p>26 ayat (1)</p>', '<p>26 ayat (2)</p>', '<p>27 ayat (1)</p>', '<p>27 ayat (2)</p>', '<p>28</p>', 'C', '', '', '', '', '', '', ''),
(432, 16, 38, '<p>Salah satu konsekuensi dalam melaksanakan demokrasi Pancasila adalah&hellip;</p>', 1, '<p>mendalami arti demokrasi Pancasila</p>', '<p>sanggup berjuang untuk kepentingan rakyat</p>', '<p>selalu menjunjung tinggi hasil musyawarah</p>', '<p>sanggup berkorban untuk kepentingan bangsa dan Negara</p>', '<p>bersikap patriotisme</p>', 'D', '', '', '', '', '', '', ''),
(433, 16, 39, '<p>Pembagian waris yang dilakukan dalam suatu keluarga termasuk hukum&hellip;</p>', 1, '<p>formal</p>', '<p>material</p>', '<p>pidana</p>', '<p>perdata</p>', '<p>privat</p>', 'D', '', '', '', '', '', '', ''),
(434, 16, 40, '<p>Lembaga yang berkewajiban memberikan putusan atas pendapat DPR mengenai dugaan pelanggaran hukum berupa pengkhianatan terhadap negara, korupsi, penyuapan, tindak pidana berat lainnya, atau perbuatan tercela yang dilakukan oleh Presiden dan atau wakil Presiden, yaitu&hellip;</p>', 1, '<p>Mahkamah Agung</p>', '<p>Mahkamah Konstitusi</p>', '<p>Komisi Yudisial</p>', '<p>Komisi Pemberantasan Korupsi</p>', '<p>Hakim Agung</p>', 'B', '', '', '', '', '', '', ''),
(435, 17, 1, '<p>Pisau dan alat-alat penyayatannya mempunyai gerak putar, sedang benda kerja terpasang pada meja dengan keadaan bergerak mendatar, tegak atau berputar secara lambat, hal ini disebut...</p>', 1, '<p>Prinsip kerja mesin bubut</p>', '<p>Prinsip kerja mesin frais</p>', '<p>Prinsip kerja mesin gerinda</p>', '<p>Prinsip kerja mesin skrap</p>', '<p>Prinsip kerja mesin bor</p>', 'B', '', '', '', '', '', '', ''),
(436, 17, 2, '<p>Mesin frais jenis ini mempunyai pemasangan spindle dengan arah horizontal dan digunakan untuk melakukan pemotongan benda kerja dengan arah mendatar disebut mesin frais&hellip;..</p>', 1, '<p>Universal</p>', '<p>Horizontal</p>', '<p>Copy</p>', '<p>Vertikal</p>', '<p>Plano</p>', 'B', '', '', '', '', '', '', ''),
(437, 17, 3, '<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; background: white; vertical-align: baseline;\"><!-- [if !supportLists]--><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"color: black; mso-color-alt: windowtext;\">Yang bukan termasuk fungsi mesin frais adalah &hellip;</span></p>', 1, '<p>Menggerinda</p>', '<p>Membesarkan lubang</p>', '<p>Membuat alur</p>', '<p>Meratakan permukaan</p>', '<p>Mengebor</p>', 'A', '', '', '', '', '', '', ''),
(438, 17, 4, '<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; background: white; vertical-align: baseline;\"><!-- [if !supportLists]--><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"color: black; mso-color-alt: windowtext;\">Ukuran mesin Frais ditentukan oleh ....</span></p>', 1, '<p>Panjangnya lutut</p>', '<p>Tingginya tiang</p>', '<p>Kapasitas langkah mejanya</p>', '<p>Panjang lengannya</p>', '<p>Panjang mejanya</p>', 'C', '', '', '', '', '', '', ''),
(439, 17, 5, '<p>Bagian yang menahan seluruh bagian-bagian mesin frais&nbsp;adalah...</p>', 1, '<p>Badan</p>', '<p>Spindel</p>', '<p>Sadel</p>', '<p>Meja</p>', '<p>Penopang</p>', 'A', '', '', '', '', '', '', ''),
(440, 17, 6, '<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; background: white; vertical-align: baseline;\"><!-- [if !supportLists]--><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"color: black; mso-color-alt: windowtext;\">Yang letaknya pada lengan mesin frais gunanya untuk menahan atau menopang ujung poros frais adalah...</span></p>', 1, '<p>Spindel</p>', '<p>Badan</p>', '<p>Lutut</p>', '<p>Penahan poros</p>', '<p>Meja</p>', 'D', '', '', '', '', '', '', ''),
(441, 17, 7, '<p>Alat yang digunakan untuk membagi sudut lingkaran benda kerja menjadi beberapa sudut yang sama besar disebut ...</p>', 1, '<p>&nbsp;Jangka tusuk</p>', '<p>Busur derajat</p>', '<p>Bevel protector</p>', '<p>Kepala pembagi</p>', '<p>Meja putar</p>', 'D', '', '', '', '', '', '', ''),
(442, 17, 8, '<p class=\"MsoListParagraph\" style=\"text-align: justify; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; background: white; vertical-align: baseline;\"><!-- [if !supportLists]--><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"IN\" style=\"color: black; mso-color-alt: windowtext; border: none windowtext 1.0pt; mso-border-alt: none windowtext 0cm; padding: 0cm; mso-ansi-language: IN;\">Fungsi end milling Cutter adalah.&hellip;</span></p>', 1, '<p>menyayat sisi tegak dan alur</p>', '<p>menyayat permukaan datar dan alur</p>', '<p>menyayat sisi tegak dan menyayat permukaan datar</p>', '<p>membesarkan lubang</p>', '<p>membuat roda gigi</p>', 'B', '', '', '', '', '', '', ''),
(443, 17, 9, '<p>Disarankan mengefrais dengan penyayatan berlawanan, hal ini dimaksudkan agar.&hellip;</p>', 1, '<p>poros tidak bergetar</p>', '<p>pisau aman pada saat penyayatan</p>', '<p>hasil pengefraisan optimal</p>', '<p>mesin frais tidak cepat rusak</p>', '<p>pemakanan dari tipis ke tebal</p>', 'A', '', '', '', '', '', '', ''),
(444, 17, 10, '<p>Pengefraisan penyayatan searah harus dihindari, hal ini bertujuan agar.&hellip;</p>', 1, '<p>benda kerja tidak terseret putaran pisau</p>', '<p>poros tidak bergetar</p>', '<p>hasil pengefraisan optimal</p>', '<p>mesin frais tidak cepat rusak</p>', '<p>pemakanan dari tipis ke tebal</p>', 'A', '', '', '', '', '', '', ''),
(445, 17, 11, '<p>Mesin frais jenis CNC di kendalikan oleh?</p>', 1, '<p>manual</p>', '<p>&nbsp;manusia</p>', '<p>&nbsp;konvensional</p>', '<p>udara tekan</p>', '<p>computer</p>', 'E', '', '', '', '', '', '', ''),
(446, 17, 12, '<p>Pisau frais yang berfungsi membuat alur pada permukaan benda kerja disebut pisau frais?</p>', 1, '<p>sisi dan muka</p>', '<p>silinder</p>', '<p>alur</p>', '<p>pengasaran</p>', '<p>Jari</p>', 'C', '', '', '', '', '', '', ''),
(447, 17, 13, '<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]-->Ragum adalah alat bantu pengoperasian mesin frais yang digunakan untuk?</p>', 1, '<p>menjepit benda kerja</p>', '<p>pemegang pisau mesin vertical</p>', '<p>pemegang pisau mesin horizontal</p>', '<p>menjepit benda kerja berbentuk silinder</p>', '<p>menyangga benda kerja yang akan dikerjakan</p>', 'A', '', '', '', '', '', '', ''),
(448, 17, 14, '<p>Putaran spindle diatur dengan mengubah?</p>', 1, '<p>kecepatan potong</p>', '<p>kecepatan penekanan</p>', '<p>kecepatan pengikatan</p>', '<p>posisi handle pengatur putaran mesin</p>', '<p>waktu pengerjaan</p>', 'D', '', '', '', '', '', '', ''),
(449, 17, 15, '<p>Waktu pengerjaan adalah?</p>', 1, '<p>jarak yang ditempuh oleh satu titik (meter) pada selubung pisau dalam waktu satu menit</p>', '<p>jarak tempuh gerak maju pisau/benda kerja dalam satuan millimeter permenit atau feet per menit</p>', '<p>durasi waktu (lamanya waktu pengerjaan) yang digunakan untuk menyelesaikan pekerjaan</p>', '<p>jumlah pengulangan penyayatan mulai dari penyayatan pertama hingga selesai</p>', '<p>seberapa dalam pemotongan yang di lakukan</p>', 'C', '', '', '', '', '', '', ''),
(450, 17, 16, '<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; background: white;\"><!-- [if !supportLists]--><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"color: black; mso-color-alt: windowtext;\">Pisau HSS dengan diameter 30mm digunakan untuk memfrais benda dengan kecepatan potong 80m/menit. Besarnya putaran mesin adalah?</span></p>', 1, '<p>859,26 rpm</p>', '<p>849,26 rpm</p>', '<p>759,26 rpm</p>', '<p>669,26 rpm</p>', '<p>879,26 rpm</p>', 'C', '', '', '', '', '', '', ''),
(451, 17, 17, '<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; background: white;\"><!-- [if !supportLists]--><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"color: black; mso-color-alt: windowtext;\">pengecekan kesejajaran ragum menggunakan alat?</span></p>', 1, '<p>gauge</p>', '<p>inside caliper</p>', '<p>dial indicator</p>', '<p>vernier caliper</p>', '<p>micrometer</p>', 'C', '', '', '', '', '', '', ''),
(452, 17, 18, '<p>pengukuran yang bertujuan mendapatkan ketelitian yang tinggi disebut pengukuran?</p>', 1, '<p>presisi</p>', '<p>tak presisi</p>', '<p>biasa</p>', '<p>langsung</p>', '<p>tak langsung</p>', 'A', '', '', '', '', '', '', ''),
(453, 17, 19, '<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; background: white;\"><!-- [if !supportLists]--><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"color: black; mso-color-alt: windowtext;\">kunci utama pengukuran yang baik adalah?</span></p>', 1, '<p>penggunaan skala yang tepat</p>', '<p>penggunaan alat ukur yang tepat</p>', '<p>pengukuran presisi</p>', '<p>pengukuran tak presisi</p>', '<p>waktu pengukuran</p>', 'B', '', '', '', '', '', '', ''),
(454, 17, 20, '<p>Alat bantu mesin yang bernama collet digunakan untuk?</p>', 1, '<p>pemegang pisau pada mesin horizontal</p>', '<p>pemegang pisau pada mesin vertical</p>', '<p>penjepit benda kerja</p>', '<p>penjepit benda kerja yang berbentuk silinder</p>', '<p>penyangga benda kerja</p>', 'B', '', '', '', '', '', '', ''),
