(456, 17, 22, '<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; background: white;\"><!-- [if !supportLists]--><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"color: black; mso-color-alt: windowtext; letter-spacing: -.1pt; background: white;\">Mesin frais terbagi menjadi beberapa jenis antara lain</span></p>', 1, '<p>Vertikal, horizontal dan universal</p>', '<p>Vertikal dan horizontal</p>', '<p>Horizontal, universal dan normal</p>', '<p>Universal dan vertical</p>', '<p>mendatar</p>', 'A', '', '', '', '', '', '', ''),
(457, 17, 23, '<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; background: white;\"><!-- [if !supportLists]--><span style=\"letter-spacing: -.1pt;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"color: black; mso-color-alt: windowtext; letter-spacing: -.1pt; background: white;\">Alat K3 yang paling sesuai digunakan pada proses pengefraisan adalah</span></p>', 1, '<p>Topi, sarung tangan dan kacamata</p>', '<p>Earplug, wearpack dan apron</p>', '<p>Topeng, earplug dan sarung tangan</p>', '<p>Sepatu safety, kacamata dan wearpack</p>', '<p>helm, sarung tangan</p>', 'D', '', '', '', '', '', '', ''),
(458, 17, 24, '<p>Langkah paling awal pada proses pengefraisan adalah</p>', 1, '<p>Setting nol benda kerja terhadap pisau</p>', '<p>Setting otomatis pergerakan meja</p>', '<p>Setting kecepatan putar spindle</p>', '<p>Setting kedalaman pemakanan</p>', '<p>setting cutting speed</p>', 'A', '', '', '', '', '', '', ''),
(459, 17, 25, '<p>Bahan pembuat pisau frais yang paling umum digunakan adalah</p>', 1, '<p>intan dan silver</p>', '<p>HSS dan karbida</p>', '<p>perunggu</p>', '<p>platina</p>', '<p>intan dan perunggu</p>', 'B', '', '', '', '', '', '', ''),
(460, 17, 26, '<p>Kepanjangan dari HSS adalah</p>', 1, '<p>high steel speed</p>', '<p>high steel sney</p>', '<p>high speed steel</p>', '<p>high speed sney</p>', '<p>high sney speed</p>', 'C', '', '', '', '', '', '', ''),
