(462, 17, 28, '<p>Berikut yang dimaksud proses kerja mesin frais adalah</p>', 1, '<p>benda kerja diam alat potong bergerak lurus bolak balik</p>', '<p>alat potong berputar, benda kerja digerakan perlahan</p>', '<p>alat potong dan benda kerja berputar</p>', '<p>benda kerja berjalan dan alat potong diam</p>', '<p>benda kerja berputar</p>', 'B', '', '', '', '', '', '', ''),
(463, 17, 29, '<p>Jenis mesin frais yang digunakan untuk membuat gambar atau tulisan dengan ukuran yang dapat diatur sesuai keinginan dengan skala tertentu disebut mesin frais</p>', 1, '<p>universal</p>', '<p>horizontal</p>', '<p>gravier</p>', '<p>CNC</p>', '<p>hobbing</p>', 'C', '', '', '', '', '', '', ''),
(464, 17, 30, '<p style=\"text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; background: white; margin: 0cm 0cm 0cm 36.0pt;\"><!-- [if !supportLists]--><span style=\"color: black; mso-color-alt: windowtext;\">Dalam pekerjaan pengefrisan tentunya kita harus memperhatikan kecepatan putaran mesin frais. Apakah penentu dari kecepatan putaran mesin frais &hellip;.</span></p>', 1, '<p>benda kerja, pisau frais, jenis mesin frais</p>', '<p>benda kerja, kecepatan potong, diameter pisau frais.</p>', '<p>benda kerja, jenis pisau frais</p>', '<p>kecepatan potong, ketebalan benda</p>', '<p>diameter pisau frais, jenis pisau frais</p>', 'B', '', '', '', '', '', '', ''),
(465, 17, 31, '<p>Pemasangan ragum pada meja mesin frais,meja dan landasan ragum harus dalam keadaan bersih, hal ini betujuan&hellip;.</p>', 1, '<p>menjaga kebersihan mesin</p>', '<p>menjaga kebersihan ragum</p>', '<p>menjaga kesejajaran mulut ragum&nbsp;terhadap meja</p>', '<p>menjaga kerataan mulut ragum</p>', '<p>menjaga kesejajaran gerak ragum</p>', 'C', '', '', '', '', '', '', '');
