(466, 17, 32, '<p><img class=\"img-responsive\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"219\" height=\"188\" /></p>\r\n<p>Proses pengefraisan sebagaimana ditunjukkan pada gambar ini, adalah metode pemotongan...</p>', 1, '<p>netral</p>', '<p>searah</p>', '<p>gabungan searah dan netral</p>', '<p>berlawanan arah</p>', '<p>turun</p>', 'D', '', '', '', '', '', '', ''),
