(469, 17, 35, '<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; background: white;\"><!-- [if !supportLists]--><span style=\"letter-spacing: -.1pt;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"color: black; mso-color-alt: windowtext; letter-spacing: -.1pt; mso-bidi-font-weight: bold;\">Jika kecepatan putaran spindle mesin frais (n) = 450 rpm dan diameter pisau frais (d) = 28 mm, maka kecepatan potong (Cs) adalah</span></p>', 1, '<p>39,6 m/menit</p>', '<p>28,6 m/menit</p>', '<p>29,6 m/menit</p>', '<p>30,6 m/menit</p>', '<p>45 m/menit</p>', 'A', '', '', '', '', '', '', ''),
(470, 17, 36, '<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; background: white;\"><!-- [if !supportLists]--><span style=\"letter-spacing: -.1pt;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"color: black; mso-color-alt: windowtext; letter-spacing: -.1pt; background: white;\">Handel yang menggerakan meja mesin frais ke arah naik turun berfungsi untuk</span></p>', 1, '<p>Mendekatkan dan menjauhkan benda kerja dari pisau pada arah vertical</p>', '<p>Mengarahkan benda kerja ke sebelah kanan kiri arah mendatar</p>', '<p>Mengarahkan benda ke depan belakang arah melintang</p>', '<p>Menjauhkan benda ke samping arah mendatar</p>', '<p>menjauhkan / mendekatkan pisau ke benda kerja arah melintang</p>', 'A', '', '', '', '', '', '', ''),
