(722, 21, 8, '<p>Sekar&nbsp; : May I get you some beverage?</p>\r\n<p>Febby : <u>Yes, I&rsquo;d love to get some tea.</u></p>\r\n<p>The underline sentence is the expression of &hellip;.</p>', 1, '<p>refusing help&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>accepting help&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>offering help</p>', '<p>offering a thing</p>', '', 'B', '', '', '', '', '', '', ''),
(723, 21, 9, '<p>Which one is the expression of offering a thing?</p>', 1, '<p>Let me put the fruits in the refrigerator.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>How about joining badminton ?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>Thank you for helping me.</p>', '<p>Would you like something to eat?</p>', '', 'D', '', '', '', '', '', '', ''),
(724, 21, 10, '<p>Which one is the expression of&nbsp; making a suggestion?</p>', 1, '<p>Would you like some oranges?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>I don&rsquo;t think I need your help.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>What do you think I should do?</p>', '<p>Why don&rsquo;t you save some of your money?</p>', '', 'D', '', '', '', '', '', '', ''),
(725, 21, 11, '<p>Alex&nbsp;&nbsp; : You look unhealthy, boy.</p>\r\n<p>Bryan : Yes, I get a headache and a stomachache.</p>\r\n<p>Alex&nbsp;&nbsp; : <u>You should go to the doctor. </u>Come on, I will accompany you.</p>\r\n<p>Bryan : Ok.</p>\r\n<p>The underlined words show&hellip;&hellip;..</p>', 1, '<p>agreement&nbsp;</p>', '<p>disagreement</p>', '<p>advice</p>', '<p>necessity</p>', '', 'C', '', '', '', '', '', '', ''),
(726, 21, 12, '<p>Andri&nbsp; : How do you feel about living overseas?</p>\r\n<p>Marta&nbsp; : I think that&rsquo;s a good opportunity for your career.</p>\r\n<p>From the dialog above we know that &hellip;&hellip;&hellip;&hellip;.</p>', 1, '<p>Andri is disagree with marta.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>Andri is giving opinion.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>Marta is asking Andri&rsquo;s opinion</p>', '<p>Andri is asking Marta&rsquo;s opinion.</p>', '', 'D', '', '', '', '', '', '', ''),
(727, 21, 13, '<p>Kate&nbsp; : We&rsquo;ll have a long holiday next month. What are you going to do?</p>\r\n<p>Yani&nbsp; : &hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;</p>\r\n<p>Kate&nbsp; : I hope you have a nice trip</p>', 1, '<p>I am thinking of going to Bali</p>', '<p>Sorry, I can&rsquo;t tell you</p>', '<p>It&rsquo;s not your business</p>', '<p>I have nothing to do</p>', '', 'A', '', '', '', '', '', '', ''),
(728, 21, 14, '<p>Dave&nbsp; : So what do you think of my singing?</p>\r\n<p>John&nbsp;&nbsp; : It&rsquo;s really good, but I suggest to try singing in a high tune.</p>\r\n<p>Dave&nbsp; : Thanks, John.</p>\r\n<p>From the dialogue about, John is &hellip;&hellip;&hellip;&hellip;&hellip;&hellip;</p>', 1, '<p>Asking for help&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>Giving an opinion&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>asking for an opinion</p>', '<p>giving help</p>', '', 'B', '', '', '', '', '', '', ''),
