(743, 21, 29, '<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"EN-GB\" style=\"mso-ansi-language: EN-GB; mso-bidi-font-weight: bold; mso-bidi-font-style: italic;\">Kevin : What is your profession?</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"EN-GB\" style=\"mso-ansi-language: EN-GB; mso-bidi-font-weight: bold; mso-bidi-font-style: italic;\">Bass<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp; </span>: I am a carpenter</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"EN-GB\" style=\"mso-ansi-language: EN-GB; mso-bidi-font-weight: bold; mso-bidi-font-style: italic;\">Kevin : What is your job?</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"EN-GB\" style=\"mso-ansi-language: EN-GB; mso-bidi-font-weight: bold; mso-bidi-font-style: italic;\">Bass<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp; </span>: &hellip;&hellip;..</span></p>', 1, '<p>I make a house&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>I built the company&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>I make and repair wooden objects and structures</p>', '<p>I cooking food and bake a cake</p>', '', 'C', '', '', '', '', '', '', ''),
(744, 21, 30, '<p>I hope tomorrow will be &hellip;&hellip;&hellip;&hellip;..than today.</p>', 1, '<p>best</p>', '<p>better</p>', '<p>good</p>', '<p>more good</p>', '', 'B', '', '', '', '', '', '', ''),
(745, 21, 31, '<p>Plamboyan Street No. 89 Jakarta</p>\r\n<p>November 27<sup>th</sup>, 2020</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;Dear Indah</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Indah, sorry I haven&rsquo;t written to you for so long. We moved into a new apartment last month and we&rsquo;ve been really busy getting settled.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It&rsquo;s a nice apartment. It is bigger than our old one. It&rsquo;s big so there are a lot of rooms to work in. It has a big living room, two bedrooms and two bathrooms. Another thing I like is the kitchen.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The apartment is on a quiet street in a good neighbourhood. There&rsquo;s also a shopping center down the street with a supermarket, some quite good restaurants and some stores.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We really enjoy living here. Do come over and have a look next time you are in the town.</p>\r\n<p>I&rsquo;ll wait.</p>\r\n<p>&nbsp;</p>\r\n<p>Love</p>\r\n<p>Shelly</p>\r\n<p>&nbsp;</p>\r\n<p>What is the letter about?</p>', 1, '<p>Shelly&rsquo;s room&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>Indah and Shelly&rsquo;s apartment&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>Shelly&rsquo;s business</p>', '<p>Shelly&rsquo;s new apartment</p>', '', 'D', '', '', '', '', '', '', ''),
