(747, 21, 33, '<p>Plamboyan Street No. 89 Jakarta</p>\r\n<p>November 27<sup>th</sup>, 2020</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;Dear Indah</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Indah, sorry I haven&rsquo;t written to you for so long. We moved into a new apartment last month and we&rsquo;ve been really busy getting settled.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It&rsquo;s a nice apartment. It is bigger than our old one. It&rsquo;s big so there are a lot of rooms to work in. It has a big living room, two bedrooms and two bathrooms. Another thing I like is the kitchen.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The apartment is on a quiet street in a good neighbourhood. There&rsquo;s also a shopping center down the street with a supermarket, some quite good restaurants and some stores.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We really enjoy living here. Do come over and have a look next time you are in the town.</p>\r\n<p>I&rsquo;ll wait.</p>\r\n<p>&nbsp;</p>\r\n<p>Love</p>\r\n<p>Shelly</p>\r\n<p>&nbsp;</p>\r\n<p>What is the purpose of the letter?</p>', 1, '<p>To tell a problem&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>To ask for advice&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>To ask for information</p>', '<p>To give information</p>', '', 'D', '', '', '', '', '', '', ''),
