(750, 21, 36, '<p>Apt BLK 30, Eunos St. 05-116</p>\r\n<p>Singapore 1441</p>\r\n<p>2<sup>nd</sup> April 2022</p>\r\n<p>&nbsp;</p>\r\n<p>Dear Liza</p>\r\n<p>I have received your letter asking me to meet you at your house this Sunday to discuss the urgent matter you have. I regret however to say that it will not be possible for me to see you on Sunday as I already have a previous appointment. I shall see you on Monday next week at 5 p.m . Hopping the change of date will be convenient to you.</p>\r\n<p>&nbsp;</p>\r\n<p>Your sincerely</p>\r\n<p>Daisy</p>\r\n<p>&nbsp;</p>\r\n<p>What does the letter tell about &hellip;&hellip;&hellip;&hellip;</p>', 1, '<p>Liza&rsquo;s problem&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>Liza&rsquo;s appointment&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>Daisy&rsquo;s previous letter to Liza</p>', '<p>Daisy&rsquo;s regret for not being able to come</p>', '', 'D', '', '', '', '', '', '', ''),
